 request is received from multiple systems. NS injects an NS record and if needed, a target record.","This is primarily for the GQBL bypass for wpad. This attack can be used with Inveigh's DNS spoofer. Wildcard injects a wildcard record.","",".PARAMETER ADIDNSACE","Default = Enabled: Enable/Disable adding an 'Authenticated Users' full control ACE to any added records.","",".PARAMETER ADIDNSCleanup","Default = Enabled: Enable/Disable removing added ADIDNS records upon shutdown.","",".PARAMETER ADIDNSCredential","PSCredential object that will be used with ADIDNS spoofing.","",".PARAMETER ADIDNSDomain","The targeted domain in DNS format.","",".PARAMETER ADIDNSDomainController","Domain controller to target. This parameter is mandatory on a non-domain attached system.","",".PARAMETER ADIDNSForest","The targeted forest in DNS format.","",".PARAMETER ADIDNSHostsIgnore","Comma separated list of hosts that will be ignored with ADIDNS spoofing.","",".PARAMETER ADIDNSNSTarget","Default = wpad2: Target for the NS attacks NS record. An existing record can be used. ","",".PARAMETER ADIDNSPartition","Default = DomainDNSZones: (DomainDNSZones,ForestDNSZones,System) The AD partition name where the zone is stored.","",".PARAMETER ADIDNSThreshold","Default = 4: The threshold used to determine when ADIDNS records are injected for the combo attack. Inveigh will","track identical LLMNR and NBNS requests received from multiple systems. DNS records will be injected once the","system count for identical LLMNR and NBNS requests exceeds the threshold.","",".PARAMETER ADIDNSTTL","Default = 600 Seconds: DNS TTL in seconds for added A records.","",".PARAMETER ADIDNSZone","The ADIDNS zone.","",".PARAMETER Challenge","Default = Random: 16 character hex NTLM challenge for use with the HTTP listener. If left blank, a random","challenge will be generated for each request.","",".PARAMETER ConsoleOutput","Default = Disabled: (Low/Medium/Y/N) Enable/Disable real time console output. If using this option through a","shell, test to ensure that it doesn't hang the shell. Medium and Low can be used to reduce output.","",".PARAMETER ConsoleQueueLimit","Default = Unlimited: Maximum number of queued up console log entries when not using the real time console. ","",".PARAMETER ConsoleStatus","(Integer) Interval in minutes for displaying all unique captured usernames, hashes, and credentials. This is useful for","displaying full capture lists when running through a shell that does not have access to the support functions.","",".PARAMETER ConsoleUnique","Default = Enabled: (Y/N) Enable/Disable displaying challenge/response hashes for only unique IP, domain/hostname,","and username combinations when real time console output is enabled.","",".PARAMETER DNS","Default = Enabled: (Y/N) Enable/Disable DNS spoofing. All detected requests will be answered with the SpooferIP.","This is primarily required for the ADIDNS NS wpad attack.","",".PARAMETER DNSTTL","Default = 30 Seconds: DNS TTL in seconds for the response packet.","",".PARAMETER Elevated","Default = Auto: (Auto/Y/N) Set the privilege mode. Auto will determine if Inveigh is running with","elevated privilege. If so, options that require elevated privilege can be used.","",".PARAMETER EvadeRG","Defauly = Disabled: (Y/N) Enable/Disable detecting and ignoring LLMNR/NBNS requests sent directly to an IP address","rather than a broadcast/multicast address. This technique is used by ResponderGuard to discover spoofers across","subnets.","",".PARAMETER FileOutput","Default = Disabled: (Y/N) Enable/Disable real time file output.","",".PARAMETER FileOutputDirectory","Default = Working Directory: Valid path to an output directory for log and capture files. FileOutput must","also be enabled.","",".PARAMETER FileUnique","Default = Enabled: (Y/N) Enable/Disable outputting challenge/response hashes for only unique IP, domain/hostname,","and username combinations when real time file output is enabled.","",".PARAMETER HTTP","Default = Enabled: (Y/N) Enable/Disable HTTP challenge/response capture.","",".PARAMETER HTTPIP","Default = Any: IP address for the HTTP/HTTPS listener.","",".PARAMETER HTTPPort","Default = 80: TCP port for the HTTP listener.","",".PARAMETER HTTPAuth","Default = NTLM: (Anonymous/Basic/NTLM/NTLMNoESS) HTTP/HTTPS listener authentication type. This setting does not","apply to wpad.dat requests. NTLMNoESS turns off the 'Extended Session Security' flag during negotiation. ","",".PARAMETER HTTPBasicRealm","Realm name for Basic authentication. This parameter applies to both HTTPAuth and WPADAuth.","",".PARAMETER HTTPContentType","Default = text/html: Content type for HTTP/HTTPS/Proxy responses. Does not apply to EXEs and wpad.dat. Set to","\"application/hta\" for HTA files or when using HTA code with HTTPResponse.","",".PARAMETER HTTPDirectory","Full directory path to enable hosting of basic content through the HTTP/HTTPS listener.","",".PARAMETER HTTPDefaultFile","Filename within the HTTPDirectory to serve as the default HTTP/HTTPS/Proxy response file. This file will not be used for","wpad.dat requests.","",".PARAMETER HTTPDefaultEXE","EXE filename within the HTTPDirectory to serve as the default HTTP/HTTPS/Proxy response for EXE requests. ","",".PARAMETER HTTPResponse","Content to serve as the default HTTP/HTTPS/Proxy response. This response will not be used for wpad.dat requests.","This parameter will not be used if HTTPDirectory is set. Use PowerShell character escapes and newlines where necessary.","",".PARAMETER HTTPS","Default = Disabled: (Y/N) Enable/Disable HTTPS challenge/response capture. Warning, a cert will be installed in","the local store. If the script does not exit gracefully, manually remove the certificate. This feature requires","local administrator access.","",".PARAMETER HTTPSPort","Default = 443: TCP port for the HTTPS listener.","",".PARAMETER HTTPSCertIssuer","Default = Inveigh: The issuer field for the cert that will be installed for HTTPS.","",".PARAMETER HTTPSCertSubject","Default = localhost: The subject field for the cert that will be installed for HTTPS.","",".PARAMETER HTTPSForceCertDelete","Default = Disabled: (Y/N) Force deletion of an existing certificate that matches HTTPSCertIssuer and","HTTPSCertSubject.","",".PARAMETER Inspect","(Switch) Inspect DNS/LLMNR/mDNS/NBNS traffic only.","",".PARAMETER IP","Local IP address for listening and packet sniffing. This IP address will also be used for LLMNR/NBNS/mDNS/DNS spoofing","if the SpooferIP parameter is not set.","",".PARAMETER Kerberos","Default = Disabled: (Y/N) Enable/Disable experimental Kerberos TGT capture and kirbi file output through unconstrained","delegation and packet sniffing. ","",".PARAMETER KerberosCount","Default = 2: The number of kirbi files that will be created per username.","",".PARAMETER KerberosCredential","Credentials that will be used to decrypt Kerberos TGT captures. This is not required if using KerberosHash. The username","should be entered in Kerberos salt format:","AD username format = uppercase realm + case sensitive username (e.g., TEST.LOCALusername, TEST.LOCALAdministrator)","AD hostname format = uppercase realm + the word host + lowercase hostname without the trailing '$' + . + lowercase","realm (e.g., TEST.LOCALhostwks1.test.local)","",".PARAMETER KerberosHash","AES256 password hash that will be used to decrypt Kerberos TGT captures. This is not required if using KerberosCredential.","",".PARAMETER KerberosHostHeader","Comma separated list of hosts that the HTTP/HTTPS/Proxy listener will compare to host headers. If a match is found, the","listener will attempt to negotiate to Kerberos.","",".PARAMETER LogOutput","Default = Enabled: (Y/N) Enable/Disable storing log messages in memory.","",".PARAMETER LLMNR","Default = Enabled: (Y/N) Enable/Disable LLMNR spoofing.","",".PARAMETER LLMNRTTL","Default = 30 Seconds: LLMNR TTL in seconds for the response packet.","",".PARAMETER MachineAccounts","Default = Disabled: (Y/N) Enable/Disable showing NTLM challenge/response captures from machine accounts.","",".PARAMETER mDNS","Default = Disabled: (Y/N) Enable/Disable mDNS spoofing.","",".PARAMETER mDNSTTL","Default = 120 Seconds: mDNS TTL in seconds for the response packet.","",".PARAMETER mDNSTypes","Default = QU: Comma separated list of mDNS types to spoof. Note that QM will send the response to 224.0.0.251.","Types include QU = Query Unicast, QM = Query Multicast","",".PARAMETER NBNS","Default = Disabled: (Y/N) Enable/Disable NBNS spoofing.","",".PARAMETER NBNSBruteForce","Default = Disabled: (Y/N) Enable/Disable NBNS brute force spoofer.","",".PARAMETER NBNSBruteForceHost","Default = WPAD: Hostname for the NBNS Brute Force spoofer.","",".PARAMETER NBNSBruteForcePause","Default = Disabled: (Integer) Number of seconds the NBNS brute force spoofer will stop spoofing after an incoming","HTTP request is received.","",".PARAMETER NBNSBruteForceTarget","IP address to target for NBNS brute force spoofing.","",".PARAMETER NBNSTTL","Default = 165 Seconds: NBNS TTL in seconds for the response packet.","",".PARAMETER NBNSTypes","Default = 00,20: Comma separated list of NBNS types to spoof. Note, not all types have been tested.","Types include 00 = Workstation Service, 03 = Messenger Service, 20 = Server Service, 1B = Domain Name","",".PARAMETER OutputStreamOnly","Default = Disabled: (Y/N) Enable/Disable forcing all output to the standard output stream. This can be helpful if","running Inveigh through a shell that does not return other output streams. Note that you will not see the various","yellow warning messages if enabled.","",".PARAMETER Pcap","Default = Disabled: (File/Memory) Enable/Disable dumping packets to a pcap file or memory. This option requires","elevated privilege. If using 'Memory', the packets will be written to the $inveigh.pcap ArrayList.","",".PARAMETER PcapTCP","Default = 139,445: Comma separated list of TCP ports to filter which packets will be written to the pcap file.","Use 'All' to capture on all ports.","",".PARAMETER PcapUDP","Default = Disabled: Comma separated list of UDP ports to filter which packets will be written to the pcap file.","Use 'All' to capture on all ports.","",".PARAMETER Proxy","Default = Disabled: (Y/N) Enable/Disable proxy listener authentication captures.","",".PARAMETER ProxyAuth","Default = NTLM: (Basic/NTLM/NTLMNoESS) Proxy listener authentication type.","",".PARAMETER ProxyIP","Default = Any: IP address for the proxy listener.","",".PARAMETER ProxyPort","Default = 8492: TCP port for the proxy listener.","",".PARAMETER ProxyIgnore","Default = Firefox: Comma separated list of keywords to use for filtering browser user agents. Matching browsers","will not be sent the wpad.dat file used for capturing proxy authentications. Firefox does not work correctly","with the proxy server failover setup. Firefox will be left unable to connect to any sites until the proxy is","cleared. Remove 'Firefox' from this list to attack Firefox. If attacking Firefox, consider setting","-SpooferRepeat N to limit attacks against a single target so that victims can recover Firefox connectivity by","closing and reopening.","",".PARAMETER RunCount","Default = Unlimited: (Integer) Number of NTLMv1/NTLMv2/cleartext captures to perform before auto-exiting.","",".PARAMETER RunTime","(Integer) Run time duration in minutes.","",".PARAMETER ShowHelp","Default = Enabled: (Y/N) Enable/Disable the help messages at startup.","",".PARAMETER SMB","Default = Enabled: (Y/N) Enable/Disable SMB challenge/response capture. Warning, LLMNR/NBNS spoofing can still","direct targets to the host system's SMB server. Block TCP ports 445/139 or kill the SMB services if you need to","prevent login requests from being processed by the Inveigh host.  ","",".PARAMETER SpooferHostsIgnore","Comma separated list of requested hostnames to ignore when spoofing with LLMNR/mDNS/NBNS.","",".PARAMETER SpooferHostsReply","Comma separated list of requested hostnames to respond to when spoofing with LLMNR/mDNS/NBNS.","",".PARAMETER SpooferIP","IP address for ADIDNS/LLMNR/mDNS/NBNS spoofing. This parameter is only necessary when redirecting victims to a system","other than the Inveigh host.","",".PARAMETER SpooferIPsIgnore","Comma separated list of source IP addresses to ignore when spoofing with LLMNR/mDNS/NBNS.","",".PARAMETER SpooferIPsReply","Comma separated list of source IP addresses to respond to when spoofing with LLMNR/mDNS/NBNS.","",".PARAMETER SpooferLearning","Default = Disabled: (Y/N) Enable/Disable LLMNR/NBNS valid host learning. If enabled, Inveigh will send out","LLMNR/NBNS requests for any received LLMNR/NBNS requests. If a response is received, Inveigh will add the","hostname to a spoofing blacklist.","",".PARAMETER SpooferLearningDelay","(Integer) Time in minutes that Inveigh will delay spoofing while valid hosts are being blacklisted through","SpooferLearning.","",".PARAMETER SpooferLearningInterval","Default = 30 Minutes: (Integer) Time in minutes that Inveigh wait before sending out an LLMNR/NBNS request for a","hostname that has already been checked if SpooferLearning is enabled.   ","",".PARAMETER SpooferNonprintable","Default = Enabled: (Y/N) Enable/Disable answering LLMNR/NBNS requests for non-printable host names.","",".PARAMETER SpooferRepeat","Default = Enabled: (Y/N) Enable/Disable repeated LLMNR/NBNS spoofs to a victim system after one user","challenge/response has been captured.","",".PARAMETER SpooferThresholdHost","(Integer) Number of matching LLMNR/NBNS name requests to receive before Inveigh will begin responding to those","requests.","",".PARAMETER SpooferThresholdNetwork","(Integer) Number of matching LLMNR/NBNS requests to receive from different systems before Inveigh will begin","responding to those requests. ","",".PARAMETER StartupChecks","Default = Disabled: (Y/N) Enable/Disable checks for in use ports and running services on startup.","",".PARAMETER StatusOutput","Default = Enabled: (Y/N) Enable/Disable startup and shutdown messages.","",".PARAMETER Tool","Default = 0: (0/1/2) Enable/Disable features for better operation through external tools such as Meterpreter's","PowerShell extension, Metasploit's Interactive PowerShell Sessions payloads and Empire.","0 = None, 1 = Metasploit/Meterpreter, 2 = Empire   ","",".PARAMETER WPADAuth","Default = NTLM: (Anonymous/Basic/NTLM/NTLMNoESS) HTTP/HTTPS listener authentication type for wpad.dat requests.","Setting to Anonymous can prevent browser login prompts. NTLMNoESS turns off the 'Extended Session Security' flag","during negotiation.","",".PARAMETER WPADAuthIgnore","Default = Firefox: Comma separated list of keywords to use for filtering browser user agents. Matching browsers","will be skipped for NTLM authentication. This can be used to filter out browsers that display login","popups for authenticated wpad.dat requests such as Firefox.   ","",".PARAMETER WPADDirectHosts","Comma separated list of hosts to list as direct in the wpad.dat file. Listed hosts will not be routed through the","defined proxy.","",".PARAMETER WPADIP","Proxy server IP to be included in the wpad.dat response for WPAD enabled browsers. This parameter must be used","with WPADPort.","",".PARAMETER WPADPort","Proxy server port to be included in the wpad.dat response for WPAD enabled browsers. This parameter must be","used with WPADIP.","",".PARAMETER WPADResponse","Default = all direct: wpad.dat file contents to serve as the wpad.dat response. This parameter will not be used if WPADIP and WPADPort","are set. Use PowerShell character escapes where necessary.","",".EXAMPLE","Import-Module .\\Inveigh.psd1;Invoke-Inveigh","Import full module and execute with all default settings.","",".EXAMPLE",". ./Inveigh.ps1;Invoke-Inveigh -IP 192.168.1.10","Dot source load and execute specifying a specific local listening/spoofing IP.","",".EXAMPLE","Invoke-Inveigh -IP 192.168.1.10 -HTTP N","Execute specifying a specific local listening/spoofing IP and disabling HTTP challenge/response.","",".EXAMPLE","Invoke-Inveigh -SpooferRepeat N -WPADAuth Anonymous -SpooferHostsReply host1,host2 -SpooferIPsReply 192.168.2.75,192.168.2.76","Execute with the stealthiest options.","",".EXAMPLE","Invoke-Inveigh -Inspect","Execute in order to only inspect LLMNR/mDNS/NBNS traffic.","",".EXAMPLE","Invoke-Inveigh -IP 192.168.1.10 -SpooferIP 192.168.2.50 -HTTP N","Execute specifying a specific local listening IP and a LLMNR/NBNS spoofing IP on another subnet. This may be","useful for sending traffic to a controlled Linux system on another subnet.","",".EXAMPLE","Invoke-Inveigh -HTTPResponse \"\u003chtml\u003e\u003chead\u003e\u003cmeta http-equiv='refresh' content='0; url=https://duckduckgo.com/'\u003e\u003c/head\u003e\u003c/html\u003e\"","Execute specifying an HTTP redirect response. ","",".LINK","https://github.com/Kevin-Robertson/Inveigh","#\u003e","","#region begin parameters","","# Parameter default values can be modified in this section: ","[CmdletBinding()]","param","( ","    [parameter(Mandatory=$false)][Array]$ADIDNSHostsIgnore = (\"isatap\",\"wpad\"),","    [parameter(Mandatory=$false)][Array]$KerberosHostHeader = \"\",","    [parameter(Mandatory=$false)][Array]$ProxyIgnore = \"Firefox\",","    [parameter(Mandatory=$false)][Array]$PcapTCP = (\"139\",\"445\"),","    [parameter(Mandatory=$false)][Array]$PcapUDP = \"\",","    [parameter(Mandatory=$false)][Array]$SpooferHostsReply = \"\",","    [parameter(Mandatory=$false)][Array]$SpooferHostsIgnore = \"\",","    [parameter(Mandatory=$false)][Array]$SpooferIPsReply = \"\",","    [parameter(Mandatory=$false)][Array]$SpooferIPsIgnore = \"\",","    [parameter(Mandatory=$false)][Array]$WPADDirectHosts = \"\",","    [parameter(Mandatory=$false)][Array]$WPADAuthIgnore = \"Firefox\",","    [parameter(Mandatory=$false)][Int]$ConsoleQueueLimit = \"-1\",","    [parameter(Mandatory=$false)][Int]$ConsoleStatus = \"\",","    [parameter(Mandatory=$false)][Int]$ADIDNSThreshold = \"4\",","    [parameter(Mandatory=$false