            $name_start = 0","","                foreach($index in $index_array)","                {","                    $name_end = $index - $name_start","                    [Byte[]]$name_array += $name_end","                    [Byte[]]$name_array += [System.Text.Encoding]::UTF8.GetBytes($Name.Substring($name_start,$name_end))","                    $name_start = $index + 1","                }","","                [Byte[]]$name_array += ($Name.Length - $name_start)","                [Byte[]]$name_array += [System.Text.Encoding]::UTF8.GetBytes($Name.Substring($name_start))","            }","            else","            {","                [Byte[]]$name_array = $Name.Length","                [Byte[]]$name_array += [System.Text.Encoding]::UTF8.GetBytes($Name.Substring($name_start))","            }","","            return $name_array","        }","","        function New-PacketDNSSOAQuery","        {","            param([String]$Name)","","            [Byte[]]$type = 0x00,0x06","            [Byte[]]$name = (New-DNSNameArray $Name) + 0x00","            [Byte[]]$length = [System.BitConverter]::GetBytes($Name.Count + 16)[1,0]","            [Byte[]]$transaction_ID = New-RandomByteArray 2","            $DNSQuery = New-Object System.Collections.Specialized.OrderedDictionary","            $DNSQuery.Add(\"Length\",$length)","            $DNSQuery.Add(\"TransactionID\",$transaction_ID)","            $DNSQuery.Add(\"Flags\",[Byte[]](0x01,0x00))","            $DNSQuery.Add(\"Questions\",[Byte[]](0x00,0x01))","            $DNSQuery.Add(\"AnswerRRs\",[Byte[]](0x00,0x00))","            $DNSQuery.Add(\"AuthorityRRs\",[Byte[]](0x00,0x00))","            $DNSQuery.Add(\"AdditionalRRs\",[Byte[]](0x00,0x00))","            $DNSQuery.Add(\"Queries_Name\",$name)","            $DNSQuery.Add(\"Queries_Type\",$type)","            $DNSQuery.Add(\"Queries_Class\",[Byte[]](0x00,0x01))","","            return $DNSQuery","        }","","        $DNS_client = New-Object System.Net.Sockets.TCPCli