,"        return [Byte[]]$SOA_serial_number_array","    }","","    function New-DNSRecordArray","    {","        [CmdletBinding()]","        [OutputType([Byte[]])]","        param","        (","            [parameter(Mandatory=$false)][String]$Data,","            [parameter(Mandatory=$false)][String]$DomainController,","            [parameter(Mandatory=$false)][ValidateSet(\"A\",\"AAAA\",\"CNAME\",\"DNAME\",\"MX\",\"NS\",\"PTR\",\"SRV\",\"TXT\")][String]$Type = \"A\",","            [parameter(Mandatory=$false)][String]$Zone,","            [parameter(Mandatory=$false)][Int]$Preference,","            [parameter(Mandatory=$false)][Int]$Priority,","            [parameter(Mandatory=$false)][Int]$Weight,","            [parameter(Mandatory=$false)][Int]$Port,","            [parameter(Mandatory=$false)][Int]$TTL = 600,","            [parameter(Mandatory=$false)][Int32]$SOASerialNumber,","            [parameter(Mandatory=$false)][Switch]$Static,","            [parameter(ValueFromRemainingArguments=$true)]$invalid_parameter","        )","","        $SOASerialNumberArray = New-SOASerialNumberArray -DomainController $DomainController -Zone $Zone","","        function New-DNSNameArray","        {","            param([String]$Name)","","            $character_array = $Name.ToCharArray()","            [Array]$index_array = 0..($character_array.Count - 1) | Where-Object {$character_array[$_] -eq '.'}","","            if($index_array.Count -gt 0)","            {","","                $name_start = 0","","                foreach($index in $index_array)","                {","                    $name_end = $index - $name_start","                    [Byte[]]$name_array += $name_end","                    [Byte[]]$name_array += [System.Text.Encoding]::UTF8.GetBytes($Name.Substring($name_start,$name_end))","                    $name_start = $index + 1","                }","","                [Byte[]]$name_array += ($Name.Length - $name_start)","                [Byte[]]$name_array += [System.Text.Encoding]::UTF8.GetBytes($Name.Substring($name_start))","            }","            else","            {","                [Byte[]]$name_array = $Name.Length","                [Byte[]]$name_array += [System.Text.Encoding]::UTF8.GetBytes($Name.Substring($name_start))","            }","","            return $name_array","        }","","        switch ($Type)","        {","","            'A'","            {","                [Byte[]]$DNS_type = 0x01,0x00","                [Byte[]]$DNS_length = ([System.BitConverter]::GetBytes(($Data.Split(\".\")).Count))[0..1]","                [Byte[]]$DNS_data += ([System.Net.IPAddress][String]([System.Net.IPAddress]$Data)).GetAddressBytes()","            }","","            'AAAA'","            {","                [Byte[]]$DNS_type = 0x1c,0x00","                [Byte[]]$DNS_length = ([System.BitConverter]::GetBytes(($Data -replace \":\",\"\").Length / 2))[0..1]","                [Byte[]]$DNS_data += ([System.Net.IPAddress][String]([System.Net.IPAddress]$Data)).GetAddressBytes()","            }","            ","            'CNAME'","            {","                [Byte[]]$DNS_type = 0x05,0x00","                [Byte[]]$DNS_length = ([System.BitConverter]::GetBytes($Data.Length + 4))[0..1]","                [Byte[]]$DNS_data = $Data.Length + 2","                $DNS_data += ($Data.Split(\".\")).Count","                $DNS_data += New-DNSNameArray $Data","                $DNS_data += 0x00","            }","","            'DNAME'","            {","                [Byte[]]$DNS_type = 0x27,0x00","                [Byte[]]$DNS_length = ([System.BitConverter]::GetBytes($Data.Length + 4))[0..1]","                [Byte[]]$DNS_data = $Data.Length + 2","                $DNS_data += ($Data.Split(\".\")).Count","                $DNS_data += New-DNSNameArray $Data","                $DNS_data += 0x00","            }","            ","            'MX'","            {","                [Byte[]]$DNS_type = 0x0f,0x00","                [Byte[]]$D