5","        }","","    }","    else","    {","        Write-Output \"[-] Inveigh isn't running\"","    }","","}","else","{","    Write-Output \"[-] Watch-Inveigh cannot be used with current external tool selection\"","}","","}","","function Clear-Inveigh","{","\u003c#",".SYNOPSIS","Clear-Inveigh will clear Inveigh data from memory.","#\u003e","","if($inveigh)","{","","    if(!$inveigh.running -and !$inveigh.relay_running)","    {","        Remove-Variable inveigh -scope global","        Write-Output \"[+] Inveigh data has been cleared from memory\"","    }","    else","    {","        Write-Output \"[-] Run Stop-Inveigh before running Clear-Inveigh\"","    }","","}","","}","","function ConvertTo-Inveigh","{","    \u003c#","    .SYNOPSIS","    ConvertTo-Inveigh imports Bloodhound computers, groups and session JSON files into $inveigh.enumerate","    for Inveigh Relay targeting.","","    .DESCRIPTION","    For the fastest import, import the data before gather any enumeration data with Inveigh.","","    .PARAMETER BloodHoundComputersJSON","    BloodHound computers file.","","    .PARAMETER BloodHoundSessionsJSON","    BloodHound sessions file.","","    .PARAMETER BloodHoundGroupsJSON","    BloodHound groups file.","","    .PARAMTER DNS","    Enable DNS lookups","    #\u003e","","    [CmdletBinding()]","    param","    ( ","        [parameter(Mandatory=$false)][ValidateScript({Test-Path $_})][String]$Computers,","        [parameter(Mandatory=$false)][ValidateScript({Test-Path $_})][String]$Sessions,","        [parameter(Mandatory=$false)][ValidateScript({Test-Path $_})][String]$Groups,","        [parameter(Mandatory=$false)][Switch]$DNS,","        [parameter(ValueFromRemainingArguments=$true)]$invalid_parameter","    )","","    if(!$Computers -and !$Sessions -and !$Groups)","    {","        Write-Output \"Specifiy a BloodHound computers, groups, or sessions JSON file\"","        throw","    }","","    if($inveigh.running -or $inveigh.relay_running)","    {","        Write-Output \"Run Stop-Inveigh before importing data with ConvertTo-Inveigh\"","        throw","    }","","    if(!$inveigh)","    {","        $global:inveigh = [HashTable]::Synchronized(@{})","        $inveigh.cleartext_list = New-Object System.Collections.ArrayList","        $inveigh.enumerate = New-Object System.Collections.ArrayList","        $inveigh.IP_capture_list = New-Object System.Collections.ArrayList","        $inveigh.log = New-Object System.Collections.ArrayList","        $inveigh.kerberos_TGT_list = New-Object System.Collections.ArrayList","        $inveigh.kerberos_TGT_username_list = New-Object System.Collections.ArrayList","        $inveigh.NTLMv1_list = New-Object System.Collections.ArrayList","        $inveigh.NTLMv1_username_list = New-Object System.Collections.ArrayList","        $inveigh.NTLMv2_list = New-Object System.Collections.ArrayList","        $inveigh.NTLMv2_username_list = New-Object System.Collections.ArrayList","        $inveigh.POST_request_list = New-Object System.Collections.ArrayList","        $inveigh.valid_host_list = New-Object System.Collections.ArrayList","        $inveigh.ADIDNS_table = [HashTable]::Synchronized(@{})","        $inveigh.relay_privilege_table = [HashTable]::Synchronized(@{})","        $inveigh.relay_failed_login_table = [HashTable]::Synchronized(@{})","        $inveigh.relay_history_table = [HashTable]::Synchronized(@{})","        $inveigh.request_table = [HashTable]::Synchronized(@{})","        $inveigh.session_socket_table = [HashTable]::Synchronized(@{})","        $inveigh.session_table = [HashTable]::Synchronized(@{})","        $inveigh.session_message_ID_table = [HashTable]::Synchronized(@{})","        $inveigh.session_lock_table = [HashTable]::Synchronized(@{})","        $inveigh.SMB_session_table = [HashTable]::Synchronized(@{})","        $inveigh.domain_mapping_table = [HashTable]::Synchronized(@{})","        $inveigh.group_table = [HashTable]::Synchronized(@{})","        $inveigh.session_count = 0","        $inveigh.session = @()","    }","","    function New-RelayEnumObject","    {","        param ($IP,$Hostname,$DNSDomain,$netBIOSDomain,$Sessions,$AdministratorUsers,$AdministratorGroups,","            $Privileged,$Shares,$NetSessions,$NetSessionsMapped,$LocalUsers,$SMB2,$Signing,$SMBServer,$DNSRecord,","            $IPv6Only,$Targeted,$Enumerate,$Execute)","","        if($Sessions -and $Sessions -isnot [Array]){$Sessions = @($Sessions)}","        if($AdministratorUsers -and $AdministratorUsers -isnot [Array]){$AdministratorUsers = @($AdministratorUsers)}","        if($AdministratorGroups -and $AdministratorGroups -isnot [Array]){$AdministratorGroups = @($AdministratorGroups)}","        if($Privileged -and $Privileged -isnot [Array]){$Privileged = @($Privileged)}","        if($Shares -and $Shares -isnot [Array]){$Shares = @($Shares)}","        if($NetSessions -and $NetSessions -isnot [Array]){$NetSessions = @($NetSessions)}","        if($NetSessionsMapped -and $NetSessionsMapped -isnot [Array]){$NetSessionsMapped = @($NetSessionsMapped)}","        if($LocalUsers -and $LocalUsers -isnot [Array]){$LocalUsers = @($LocalUsers)}","","        $relay_object = New-Object PSObject","        Add-Member -InputObject $relay_object -MemberType NoteProperty -Name \"Index\" $inveigh.enumerate.Count","        Add-Member -InputObject $relay_object -MemberType NoteProperty -Name \"IP\" $IP","        Add-Member -InputObject $relay_object -MemberType NoteProperty -Name \"Hostname\" $Hostname","        Add-Member -InputObject $relay_object -MemberType NoteProperty -Name \"DNS Domain\" $DNSDomain","        Add-Member -InputObject $relay_object -MemberType NoteProperty -Name \"netBIOS Domain\" $netBIOSDomain","        Add-Member -InputObject $relay_object -MemberType NoteProperty -Name \"Sessions\" $Sessions","        Add-Member -InputObject $relay_object -MemberType NoteProperty -Name \"Administrator Users\" $AdministratorUsers","        Add-Member -InputObject $relay_object -MemberType NoteProperty -Name \"Administrator Groups\" $AdministratorGroups","        Add-Member -InputObject $relay_object -MemberType NoteProperty -Name \"Privileged\" $Privileged","        Add-Member -InputObject $relay_object -MemberType NoteProperty -Name \"Shares\" $Shares","        Add-Member -InputObject $relay_object -MemberType NoteProperty -Name \"NetSessions\" $NetSessions","        Add-Member -InputObject $relay_object -MemberType NoteProperty -Name \"NetSessions Mapped\" $NetSessionsMapped","        Add-Member -InputObject $relay_object -MemberType NoteProperty -Name \"Local Users\" $LocalUsers","        Add-Member -InputObject $relay_object -MemberType NoteProperty -Name \"SMB2.1\" $SMB2","        Add-Member -InputObject $relay_object -MemberType NoteProperty -Name \"Signing\" $Signing","        Add-Member -InputObject $relay_object -MemberType NoteProperty -Name \"SMB Server\" $SMBServer","        Add-Member -InputObject $relay_object -MemberType NoteProperty -Name \"DNS Record\" $DNSRecord","        Add-Member -InputObject $relay_object -MemberType NoteProperty -Name \"IPv6 Only\" $IPv6Only","        Add-Member -InputObject $relay_object -MemberType NoteProperty -Name \"Targeted\" $Targeted","        Add-Member -InputObject $relay_object -MemberType NoteProperty -Name \"Enumerate\" $Enumerate","        Add-Member -InputObject $relay_object -MemberType NoteProperty -Name \"Execute\" $Execute","        ","        return $relay_object","    }","","    function Get-DNSEntry([String]$hostname)","    {","","        try","        {","            $IP_list = [System.Net.Dns]::GetHostEntry($hostname)","","            foreach($entry in $IP_list.AddressList)","            {","","                if(!$entry.IsIPv6LinkLocal)","                {","                    $IP = $entry.IPAddressToString","                }","","            }","                    ","        }","        catch","        {","            $IP = $null","        }","","        return $IP","    }","","    # JSON parsing from http://wahlnetwork.com/2016/03/15/deserializing-large-json-payloads-powershell-objects/ ","    function Invoke-ParseItem($JSONItem) ","    {","","        if($JSONItem.PSObject.TypeNames -match 'Array') ","        {","            return Invoke-ParseJsonArray($JSONItem)","        }","        elseif($JSONItem.PSObject.TypeNames -match 'Dictionary') ","        {","            return Invoke-ParseJsonObject([HashTable]$JSONItem)","        }","        else ","        {","            return $JSONItem","        }","","    }","","    function Invoke-ParseJsonObject($JSONObject) ","    {","        $result = New-Object -TypeName PSCustomObject","","        foreach($key in $JSONObject.Keys) ","        {","            $item = $JSONObject[$key]","","            if ($item) ","            {","                $parsed_item = Invoke-ParseItem $item","            }","            else ","            {","                $parsed_item = $null","            }","","            $result | Add-Member -MemberType NoteProperty -Name $key -Value $parsed_item","        }","","        return $result","    }","","    function Invoke-ParseJSONArray($JSONArray) ","    {","        $result = @()","        $stopwatch_progress = [System.Diagnostics.Stopwatch]::StartNew()","        $i = 0","","        $JSONArray | ForEach-Object -Process {","","            if($stopwatch_progress.Elapsed.TotalMilliseconds -ge 500)","            {","                $percent_complete_calculation = [Math]::Truncate($i / $JSONArray.count * 100)","","                if($percent_complete_calculation -le 100)","                {","                    Write-Progress -Activity \"Parsing JSON\" -Status \"$percent_complete_calculation% Complete:\" -PercentComplete $percent_complete_calculation -ErrorAction SilentlyContinue","                }","","                $stopwatch_progress.Reset()","                $stopwatch_progress.Start()","            }","","            $i++","            $result += , (Invoke-ParseItem $_)}","","        return $result","    }","","    function Invoke-ParseJSONString($json) ","    {","        $config = $javaScriptSerializer.DeserializeObject($json)","","        return Invoke-ParseJsonObject $config","    }","","    [void][System.Reflection.Assembly]::LoadWithPartialName(\"System.Web.Extensions\")","","    if($inveigh.enumerate.Count -eq 0)","    {","        $enumerate_empty = $true","    }","","    if($Computers)","    {       ","        $Computers = (Resolve-Path $Computers).Path","        $computers_serializer = New-Object -TypeName System.Web.Script.Serialization.JavaScriptSerializer","        $computers_serializer.MaxJsonLength = 104857600","        $bloodhound_computers = [System.IO.File]::ReadAllText($Computers)","        $bloodhound_computers = $computers_serializer.DeserializeObject($bloodhound_computers)","        Write-Output \"[*] Parsing BloodHound Computers JSON\"","        $stopwatch_parse = [System.Diagnostics.Stopwatch]::StartNew()","        $bloodhound_computers = Invoke-ParseItem $bloodhound_computers","        Write-Output \"[+] Parsing completed in $([Math]::Truncate($stopwatch_parse.Elapsed.TotalSeconds)) seconds\"","        $stopwatch_parse.Reset()","        $stopwatch_parse.Start()","        Write-Output \"[*] Importing computers to Inveigh\"","        $stopwatch_progress = [System.Diagnostics.Stopwatch]::StartNew()","        $i = 0","","        if(!$bloodhound_computers.Computers)","        {","            Write-Output \"[!] JSON computers parse failed\"","            throw","        }","","        $bloodhound_computers.Computers | ForEach-Object {","","            if($stopwatch_progress.Elapsed.TotalMilliseconds -ge 500)","            {","                $percent_complete_calculation = [Math]::Truncate($i / $bloodhound_computers.Computers.Count * 100)","","                if($percent_complete_calculation -le 100)","                {","                    Write-Progress -Activity \"[*] Importing computers\" -Status \"$percent_complete_calculation% Complete:\" -PercentComplete $percent_complete_calculation -ErrorAction SilentlyContinue","                }","","                $stopwatch_progress.Reset()","                $stopwatch_progress.Start()","            }","","            $hostname = $_.Name","            [Array]$local_admin_users = $_.LocalAdmins | Where-Object {$_.Type -eq 'User'} | Select-Object -expand Name","            [Array]$local_admin_groups = $_.LocalAdmins | Where-Object {$_.Type -eq 'Group'} | Select-Object -expand Name","","            if($DNS)","            {","                $IP = Get-DNSEntry $hostname","","                if(!$IP)","                {","                    Write-Output \"[-] DNS lookup for $Hostname failed\"","                }","","            }","","            if(!$enumerate_empty)","            {","","                for($i = 0;$i -lt $inveigh.enumerate.Count;$i++)","                {","","                    if(($hostname -and $inveigh.enumerate[$i].Hostname -eq $hostname) -or ($IP -and $inveigh.enumerate[$i].IP -eq $IP))","                    {","","                        if($inveigh.enumerate[$i].Hostname -ne $hostname -and $inveigh.enumerate[$i].IP -eq $IP)","                        {","","                            for($j = 0;$j -lt $inveigh.enumerate.Count;$j++)","                            {","","                                if($inveigh.enumerate[$j].IP -eq $target)","                                {","                                    $target_index = $j","                                    break","                                }","","                            }","","                            $inveigh.enumerate[$target_index].Hostname = $hostname","                        }","                        else","                        {","","                            for($j = 0;$j -lt $inveigh.enumerate.Count;$j++)","                            {","","                                if($inveigh.enumerate[$j].Hostname -eq $hostname)","                                {","                                    $target_index = $j","                                    break","                                }","","                            }","","                        }","","                        $inveigh.enumerate[$target_index].\"Administrator Users\" = $local_admin_users","                        $inveigh.enumerate[$target_index].\"Administrator Groups\" = $local_admin_groups","                    }","                    else","                    {","                        $inveigh.enumerate.Add((New-RelayEnumObject -Hostname $_.Name -IP $IP -AdministratorUsers $local_admin_users -AdministratorGroups $local_admin_groups)) \u003e $null","                    }","","                }","","            }","            else","            {","                $inveigh.enumerate.Add((New-RelayEnumObject -Hostname $_.Name -IP $IP -AdministratorUsers $local_admin_users -AdministratorGroups $local_admin_groups)) \u003e $null","            }","","            $IP = $null","            $hostname = $null","            $local_admin_users = $null","            $local_admin_groups = $null","            $target_index = $null","            $i++","        }","","        Write-Output \"[+] Import completed in $([Math]::Truncate($stopwatch_parse.Elapsed.TotalSeconds)) seconds\"","        $stopwatch_parse.Reset()","        Remove-Variable bloodhound_computers","    }","","    if($Sessions)","    {","        $Sessions = (Resolve-Path $Sessions).Path","        $sessions_serializer = New-Object -TypeName System.Web.Script.Serialization.JavaScriptSerializer","        $sessions_serializer.MaxJsonLength = 104857600","        $bloodhound_sessions = [System.IO.File]::ReadAllText($Sessions)","        $bloodhound_sessions = $sessions_serializer.DeserializeObject($bloodhound_sessions)","        $stopwatch_parse = [System.Diagnostics.Stopwatch]::StartNew()","        Write-Output \"[*] Parsing BloodHound Sessions JSON\"","        $bloodhound_sessions = Invoke-ParseItem $bloodhound_sessions","        Write-Output \"[+] Parsing completed in $([Math]::Truncate($stopwatch_parse.Elapsed.TotalSeconds)) seconds\"","        $stopwatch_parse.Reset()","        $stopwatch_parse.Start()","        Write-Output \"[*] Importing sessions to Inveigh\"","        $stopwatch_progress = [System.Diagnostics.Stopwatch]::StartNew()","        $i = 0","","        if(!$bloodhound_sessions.Sessions)","        {","            Write-Output \"[!] JSON sessions parse failed\"","            throw","        }","","        $bloodhound_sessions.Sessions | ForEach-Object {","            ","            if($stopwatch_progress.Elapsed.TotalMilliseconds -ge 500)","            {","                $percent_complete_calculation = [Math]::Truncate($i / $bloodhound_sessions.Sessions.Count * 100)","","                if($percent_complete_calculation -le 100)","                {","                    Write-Progress -Activity \"[*] Importing sessions\" -Status \"$percent_complete_calculation% Complete:\" -PercentComplete $percent_complete_calculation -ErrorAction SilentlyContinue","                }","","                $stopwatch_progress.Reset()","                $stopwatch_progress.Start()","            }","","            $hostname = $_.ComputerName","","            if($hostname -as [IPAddress] -as [Bool])","            {","                $IP = $hostname","                $hostname = $null","","                for($i = 0;$i -lt $inveigh.enumerate.Count;$i++)","                {","","                    if($inveigh.enumerate[$i].IP -eq $target)","                    {","                        $target_index = $i","                        break","                    }","","                }","","            }","            else","            {","                for($i = 0;$i -lt $inveigh.enumerate.Count;$i++)","                {","","                    if($inveigh.enumerate[$i].Hostname -eq $hostname)","           